INSERT INTO `cast` VALUES (1,1,4361,NULL,NULL,1,NULL,'2003-10-20 15:18:37',NULL,NULL,NULL,'Buffy Summers'),(2,40782,4361,NULL,NULL,1,NULL,'2003-10-20 15:18:37',NULL,NULL,NULL,'Alexander Harris'),(3,2,4361,NULL,NULL,1,NULL,'2003-10-20 15:18:37',NULL,NULL,NULL,'Willow Rosenberg'),(5,40774,4361,NULL,NULL,1,NULL,'2003-10-20 15:18:37',NULL,NULL,NULL,'Cordelia Chase'),(6,40776,4361,NULL,NULL,1,NULL,'2003-10-20 18:29:25',NULL,NULL,NULL,'Tara MacLay'),(40823,40822,4361,NULL,NULL,1,NULL,'2003-10-20 15:18:37',NULL,NULL,NULL,'Faith'),(40825,40781,4361,NULL,NULL,1,NULL,'2003-10-20 15:18:37',NULL,NULL,NULL,'Angel'),(40827,40780,4361,NULL,NULL,1,NULL,'2003-10-20 15:18:37',NULL,NULL,NULL,'Rupert Giles'),(40829,40790,5653,NULL,NULL,1,NULL,'2004-05-20 13:08:40','shows/charmed/images/cast/piper.jpg',NULL,'Piper Halliwell ist die zweitälteste, bodenständigste und kreativste der drei Schwestern. Sie besitzt die Fähigkeit, die Zeit anhalten zu können. Meistens muß sie als Vermittlerin zwischen ihren Schwestern herhalten, die die Welt aus verschiedenen Blickwinkeln sehen. Piper arbeitet als Chef und Restaurant-Managerin.','Piper Halliwell'),(40830,40781,2206,NULL,NULL,1,NULL,'2003-10-20 15:18:37',NULL,NULL,NULL,'Angel'),(40832,40787,5653,NULL,NULL,1,NULL,'2004-05-20 13:08:27','shows/charmed/images/cast/prue.jpg',NULL,'Prue Halliwell ist die älteste der drei Schwestern und gleichzeitig die treibende Kraft. Sie besitzt die Fähigkeit, Dinge zu bewegen. Als starke Person paßt sie auf ihre jüngeren Schwestern auf, allerdings hat sie Schwierigkeiten, ihren Gefühlen Ausdruck zu verleihen. Sie ist eine Expertin in altertümlichen Artefakten, da sie bereits in einem Museum und einem Auktionshaus gearbeitet hat.','Prudence Halliwell'),(40834,40778,5653,NULL,NULL,1,NULL,'2004-05-20 13:05:31','shows/charmed/images/cast/phoebe.jpg',NULL,'Phoebe ist die jüngste, lebhafteste und sorgloseste der drei Schwestern. Sie besitzt die Fähigkeit, in die Zukunft zu schauen. Sie plant ihr Leben selten über den nächsten Tag hinaus und scheint verantwortunglos zu sein - zumindestens in Prues Augen. Sie ist von der Tatsache, daß die Schwestern Hexen sind, und daß sie diejenige war, die das Buch der Schatten entdeckt hat, faziniert.','Phoebe Halliwell'),(41106,NULL,4361,NULL,NULL,2,NULL,'2003-10-20 20:44:35',NULL,NULL,NULL,'Amy'),(41108,40784,4361,NULL,NULL,1,NULL,'2003-10-20 20:45:19',NULL,NULL,NULL,'Daniel \"Oz\" Osbourne'),(41111,41110,2206,NULL,NULL,2,NULL,'2003-10-20 20:46:03',NULL,NULL,NULL,'Kate'),(41113,40789,5653,NULL,NULL,1,NULL,'2004-05-20 12:48:42','shows/charmed/images/cast/leo.jpg',NULL,NULL,'Leo Wyatt'),(41115,NULL,27463,NULL,NULL,1,NULL,'2003-10-20 21:04:13',NULL,NULL,NULL,'B\'Elanna Torres'),(41118,41117,27463,NULL,NULL,1,NULL,'2003-10-20 21:05:14',NULL,NULL,NULL,'Seven of Nine'),(41121,41120,38112,NULL,NULL,1,NULL,'2003-10-20 21:05:59',NULL,NULL,NULL,'Gabrielle'),(41124,41123,38112,NULL,NULL,1,NULL,'2003-10-20 21:06:20',NULL,NULL,NULL,'Xena'),(41126,41133,21290,NULL,NULL,1,'Manja Döring','2004-05-23 19:56:17','shows/roswell/images/cast/shiri_appleby.jpg',NULL,'','Liz Parker'),(41129,41128,15625,NULL,NULL,1,NULL,'2003-10-20 21:19:07',NULL,NULL,NULL,'Niles Crane'),(41132,41131,15625,NULL,NULL,1,NULL,'2003-10-20 21:19:37',NULL,NULL,NULL,'Daphne Moon'),(41136,41135,21290,NULL,NULL,1,'Ulrike Stürzbecher','2004-05-23 19:56:46','shows/roswell/images/cast/katherine_heigl.jpg',NULL,'','Isabel Evans'),(42206,42205,38972,NULL,NULL,1,NULL,'2003-10-21 20:36:15',NULL,NULL,NULL,'Eliott'),(49863,40795,21290,NULL,NULL,1,NULL,'2004-05-23 19:56:28','shows/roswell/images/cast/majandra_delfino.jpg',NULL,'','Maria DeLuca'),(49865,40792,21290,NULL,NULL,1,NULL,'2004-05-23 19:55:58','shows/roswell/images/cast/jason_behr.jpg',NULL,'','Max Evans'),(49867,40796,21290,NULL,NULL,1,NULL,'2004-05-23 19:56:11','shows/roswell/images/cast/brendan_fehr.jpg',NULL,'','Michael Guerin'),(49871,49868,21290,NULL,NULL,1,NULL,'2004-05-23 19:56:05','shows/roswell/images/cast/emilie_de_ravin.jpg',NULL,'','