004-05-28 20:54:57','shows/sister/images/cast/roger.jpg',NULL,'Roger is the next door neighbor who constantly flirts with the twins...or any other girl for that matter. He is not very popular at school and often gets himself into trouble.','Roger Evans'),(58975,58974,55850,NULL,NULL,1,NULL,'2004-05-30 12:40:02','shows/wilay/images/cast/lauren_small.jpg','shows/wilay/images/cast/lauren.jpg','','Lauren'),(58978,58977,55850,NULL,NULL,1,NULL,'2004-05-30 12:41:16','shows/wilay/images/cast/tina_small.jpg','shows/wilay/images/cast/tina.jpg','','Tina'),(58981,58980,55850,NULL,NULL,1,NULL,'2004-05-30 12:44:25','shows/wilay/images/cast/henry_small.jpg','shows/wilay/images/cast/henry.jpg','','Henry'),(58984,58983,55850,NULL,NULL,1,NULL,'2004-05-30 12:45:07','shows/wilay/images/cast/vince_small.jpg','shows/wilay/images/cast/vince.jpg','','Vince'),(59465,59464,57409,NULL,NULL,1,NULL,'2004-06-05 17:28:43',NULL,NULL,'','Paul Hennessy'),(59468,59467,57409,NULL,NULL,1,NULL,'2004-06-05 17:29:03',NULL,NULL,'','Cate Hennessy'),(59473,59470,57409,NULL,NULL,1,NULL,'2004-06-05 17:29:41',NULL,NULL,'','Bridget Hennessy'),(59476,59475,57409,NULL,NULL,1,NULL,'2004-06-05 17:30:01',NULL,NULL,'','Kerry Hennessy'),(59479,59478,57409,NULL,NULL,1,NULL,'2004-06-05 17:30:33',NULL,NULL,'','Rory Hennessy'),(59557,59556,37021,NULL,NULL,1,NULL,'2004-06-05 19:02:45',NULL,NULL,'','Det. Nick O\'Malley'),(59562,59559,37021,NULL,NULL,1,NULL,'2004-06-05 19:03:09',NULL,NULL,'','Det. Kate Benson'),(59565,59564,37021,NULL,NULL,1,NULL,'2004-06-05 19:03:37',NULL,NULL,'','Capt. Richard Page'),(59568,59567,37021,NULL,NULL,1,NULL,'2004-06-05 19:03:59',NULL,NULL,'','Carl the Gnome'),(59571,59570,37021,NULL,NULL,1,NULL,'2004-06-05 19:04:19',NULL,NULL,'','Sean Radmon'),(59878,59877,12524,NULL,NULL,1,'Johannes Raspe','2004-06-07 20:07:42',NULL,NULL,'','Eric Foreman'),(59881,59880,12524,NULL,NULL,1,'Andrea Imme','2004-06-12 13:57:46',NULL,NULL,'','Jackie Beulah Burkhardt'),(59884,59883,12524,NULL,NULL,1,'Marc Oliver Schulze','2004-06-12 13:57:27',NULL,NULL,'','Michael Kelso'),(59887,59886,12524,NULL,NULL,1,'Dominik Auer','2004-06-07 20:09:29',NULL,NULL,'','Stephen Hyde'),(59890,59889,12524,NULL,NULL,1,'Solveig Duda','2004-06-12 13:58:30',NULL,NULL,'','Donna Pinciotti'),(59893,59892,12524,NULL,NULL,1,'Matthias von Stegmann','2004-06-07 20:10:35',NULL,NULL,'','Fez'),(59896,59895,12524,NULL,NULL,1,'Uschi Wolff','2004-06-07 20:11:08',NULL,NULL,'','Kitty Foreman'),(59899,59898,12524,NULL,NULL,1,'Erich Ludwig','2004-06-12 13:58:53',NULL,NULL,'','Red Foreman'),(59902,59901,12524,NULL,NULL,1,'Marietta Meade','2004-06-12 13:58:06',NULL,NULL,'','Midge Pinciotti'),(59905,59904,12524,NULL,NULL,1,'Hans-Rainer Müller','2004-06-12 13:58:43',NULL,NULL,'','Bob Pinciotti'),(59908,59907,12524,NULL,NULL,1,'Veronika Neugebauer','2004-06-07 20:13:12',NULL,NULL,'','Laurie Foreman'),(60176,60175,41063,NULL,NULL,1,NULL,'2004-06-12 16:21:51',NULL,NULL,'','Tony DiMeo'),(60179,60178,41063,NULL,NULL,1,NULL,'2004-06-12 16:22:15',NULL,NULL,'','Frank DiMeo'),(60182,60181,41063,NULL,NULL,1,NULL,'2004-06-12 16:22:31',NULL,NULL,'','Carmen Cruz'),(60185,60184,41063,NULL,NULL,1,NULL,'2004-06-12 16:23:01',NULL,NULL,'','Stuey Mandelker'),(60187,40795,41063,NULL,NULL,1,NULL,'2004-06-12 16:23:15',NULL,NULL,'','Tina DiMeo'),(60190,60189,41063,NULL,NULL,1,NULL,'2004-06-12 16:23:45',NULL,NULL,'','Mickey DiMeo'),(65439,65438,65423,NULL,NULL,1,NULL,'2004-11-07 10:50:55','shows/joan/images/cast/will_small.jpg',NULL,'<p>Will wurde in Chicago geboren und beschloss direkt nach der High School Polizist zu werden. Nachdem Will einen anonymen Tipp erfand um einen Dealer aufliegen zulassen, wurden er von seinem hohen Rang degradiert und musste wieder von vorne anfangen. Er arbeite sich wieder nach oben und wurde Polizeichef von Arcadia. Jedoch löste er die Polizei von Arcadia auf, als er einen großen Bestechungsskandal entdeckte. Drauf bekam er das Angebot Leiter der Arcadia Polizei zu werden, was Will aber lehnte, da er die Arbeit als Detektiv bevorzugt und lieber auf den Straßen ist, als Büroarbeit zu erledigen.</p>','Will Giradi'),(65442,65441,65423,NULL,NULL,1,NULL,'2004-11-07 10:50:31','shows/joan/images/cast/helen_small.jpg',NULL,'<p>Helen ist eine Ehefrau, eine Mutter, eine Künstlerin und eine Lehrerin. Sie wuchs in den Süd-Staaten auf und flog von der Kunstakademie. Worauf sie ein anderes College aufsuchte um die Lehrlizenz zu erhalten.</p>\r\n<p>An der Arcadia High arbeitet Helen zunächst als Sekretärin, bis eine Stelle für den Kunstlehrer offen wird und mit Wills drängen nimmt sie diese auch an. Seit dem sie wieder Kunst unterrichtet, lässt sie auch ihrer künstlerischen Seite freien lauf und stellt ihre Gemälde in Galerien aus.</p>\r\n<p>Durch die Arbeit wurde Helen eine sehr beschäftigte Frau, findet aber dennoch Zeit für ihre Familie, die sie über alles liebt. Jedoch ist Helen ziemlich unsicher was Joans Beziehung zu Gott betrifft, sie bemerkt starke Veränderungen an ihrer Tochter.</p>','Helen Giradi'),(65445,65444,65423,NULL,NULL,1,NULL,'2004-11-07 10:48:02','shows/joan/images/cast/joan_small.jpg',NULL,'<p>Joan ist ein typisches 16jähriges Mädchen. Sie ist sarkastisch, widerspricht dauernd ihren Eltern, geht nicht gerne zur Schule, wünscht sich einen Freund und spricht zu Gott. Das letzte ist wohl nicht mehr so typisch. Aber Joan war mal ganz durchschnittlich, bis Gott sie auserwählte seine Missionen des Guten zu erfüllen. Alles was Gott will ist, das jede seiner Kreationen seine eigentliche Bestimmung erfüllt und um dies zu erreichen, braucht er die Hilfe von Joan.</p>\r\n<p>Doch Gott sieht auch das in Joan was unter der Teeangerangst und der sackartigen Kleidung versteckt ist, einen guten Menschen. Egal wie es mit ihr selbst steht, Joan sorgt sich immer um andere Menschen  eine Eigenschaft die sich nicht über Nacht entwickelte, Joan war schon immer Hilfsbereit.</p>\r\n<p>Anfangs wollte sie nicht Gottes Aufgaben erledigen, sie befürchte man würde sie für verrückt erklären, doch mit den Aufgaben begann Joan die Menschen um sich kennen zulernen und ihre Probleme zu verstehen. Durch eine Aufgabe fand sie auch ihre neuen Freunde, Grace Polk und Adam Rove und verbringt seitdem ihre Zeit mit ihnen.</p>\r\n<p>Trotzdem hat Joan immer noch Einwände bei manchen Aufgaben von Gott, jedoch willigt sie meist ein, schließlich ist er ja Gott. Und durch ihn entwickelt sich Joan zu einer großartigen Person.</p>','Joan Giradi'),(65448,65447,65423,NULL,NULL,1,NULL,'2004-11-07 10:49:03','shows/joan/images/cast/kevin_small.jpg',NULL,'<p>Kevin wuchs als ein Gutaussehender, populärer Athlet auf. Er war in der Basketballmannschaft, sollte später für die Arizona Universität spielen und hatte eine Freundin namens Beth, die er mehr als verehrte. Doch all dies änderte sich an einem verhängnisvollen Tag. Wie es am Ende der High School üblich war, ging Kevin zu einer Party und betrank sich. Dort stellte ihm seine Freundin wegen einer Affäre zur Rede und erprobt machte Kevin Schluss. Betrunken setzte er sich in ein Auto, das ebenfalls von einem Betrunken gefahren wurde und geriet in einen schrecklichen Autounfall. Seit diesem Tag ist Kevin an einen Rollstuhl gefesselt.</p>\r\n<p>Anfangs akzeptierte Kevin seine Behinderung nicht. Er hat seitdem Unfall kein Gefühl mehr in den Beinen und bekam keine Heilungschancen von den Ärzten. Durch diese Tatsache verbitterte er und ist nicht mehr gut anzusprechen. Statt freundlicher Konversation macht er lieber sarkastische Anmerkungen und legt sich mit jeden an, insbesondere mit seinem Vater. Schließ aber half Joan Kevin durch eine Aufgabe von Gott sein Leben in die richtige Bahn zuschieben. Sie überzeugte ihm sein Leben zu akzeptieren wie es ist und das Beste daraus zu machen.</p>\r\n<p>Kurze Zeit später begann Kevin bei der Zeitung Arcadia Herald zuarbeiten. Dort entwickelte er auch einen Beziehung zu Rebecca, seinem Boss. Sie überzeugte ihm als Journalist für die Zeitung zu schreiben und er entdeckte sein Talent dafür. Doch wie Kevin ist, gefährdete er die Beziehung zu Rebecca, indem er sich mit einer Frau einließ, die er nur interviewen  sollte. Ebenfalls hat Kevin wieder begonnen Basketball zuspielen  er trat der Rollstuhlmannschaft bei.</p>','Kevin Giradi'),(65451,65450,65423,NULL,NULL,1,NULL,'2004-11-07 10:49:54','shows/joan/images/cast/luke_small.jpg',NULL,'<p>Freak, Verrückter, Trottel; dies sind Namen die Luke über die Jahre zuhören bekam und sie auch tolerierte. Überaus intelligent und mit einer Gabe für die Wissenschaft gesegnet, musste sich Luke diese und andere Behandlungen nicht nur von seinen Mitschülern gefallen lassen, sondern auch von seinem älteren Bruder und seiner Schwester. Von außen sah es aus als würde das Luke nichts anhaben, aber innerlich schmerzten es im sehr, insbesondere die Behandlung von seiner Familie und das schlechte Zusammenleben mit seinem Bruder Kevin. Daraus resultierte die Freude von Luke als er erfuhr dass sein Bruder für immer an den Rollstuhl gefesselt sei. Endlich würde Kevin erfahren was es für ein Gefühl ist, wenn jemand auf einen herab sieht.</p>\r\n<p>Abgesehen davon liebt es Luke zu experimentieren und neues zu lernen. Nach einer Zeit fand er auch Freunde die dasselbe Interesse teilen, Glynis und Friedman. Glynis wollte aber mehr als nur eine freundschaftliche Beziehung, sie verliebte sich in Luke. Luke bemerkte dies aber nicht und erfuhr es erst von Friedman. Sein Interesse galt nur Grace, die ihm aber abwies und er darauf eine Beziehung mit Glynis einging. Er mochte sie zwar sehr, doch ihrer Beziehung mangelte es an Stabilität, Luke war einfach nicht wirklich verliebt. Nachdem Glynis einen Kurs für Make-Up belegte, entdeckte sie neues Selbstvertrauen in ihr und bemerkte die Blicke der Jungs in der Schule. Luke der das auch sah, verstand das Glynis Zeit braucht um mit dieser neuen Situation klar zukommen und beendete die Beziehung.</p>\r\n<p>Weiterhin galt aber sein Interesse der Person die ihm seinen ersten Kuss schenkte, nämlich Grace.</p>','Luke Giradi'),(65454,65453,65423,NULL,NULL,1,NULL,'2004-11-07 10:41:21','shows/joan/images/cast/adam_small.jpg',NULL,'','Adam Rove'),(68259,42205,NULL,67595,NULL,1,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Dr. Elliot Reid'),(68260,67698,NULL,67595,NULL,1,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Dr. John Michael \"J.D.\" Dorian'),(68261,67700,NULL,67595,NULL,1,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Dr. Robert \"Bob\" Kelso'),(68262,67702,NULL,67595,NULL,1,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Dr. Percival \"Perry\" Cox'),(68263,67704,NULL,67595,NULL,1,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Dr. Christopher \"Chris\" Duncan Turk'),(68264,67706,NULL,67595,NULL,1,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Nurse Carla Espinosa'),(68265,67708,NULL,67595,NULL,2,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Ted Buckland'),(68266,67710,NULL,67595,NULL,2,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Nurse Laverne Roberts'),(68267,67712,NULL,67595,NULL,2,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Janitor'),(68268,67714,NULL,67595,NULL,2,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Dr. Todd Quinlan'),(68269,67716,NULL,67595,NULL,3,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Mr. Burski'),(68270,67718,NULL,67595,NULL,3,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Boy'),(68271,67720,NULL,67595,NULL,3,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Billy'),(68272,67722,NULL,67595,NULL,3,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Mrs. Pratt'),(68273,67724,NULL,67595,NULL,3,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Old Woman'),(68274,67726,NULL,67595,NULL,3,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Dr. Jeffrey Steadman'),(68275,67728,NULL,67595,NULL,3,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Pizza Guy'),(68276,67730,NULL,67595,NULL,3,NULL,'2007-03-01 16:13:52',NULL,NULL,NULL,'Nurse Kearney'),(68279,42205,NULL,67597,NULL,1,NULL,'2007-03-01 16:13:56',NULL,NULL,NULL,'Dr. Elliot Reid'),(68280,67702,NULL,67597,NULL,1,NULL,'2007-03-01 16:13:56',NULL,NULL,NULL,'Dr. Percival \"Perry\" Cox'),(