INSERT INTO `summary` VALUES (67569,67543,2,'Three very different teenage girls, Emma, Cleo and Rikki, facing everyday teenage problems. With a twist: they\'re mermaids; after discovering a magic place where they are given incredible powers over water that change their lives forever.','2007-03-01 12:18:01'),(67570,67544,2,'Annoying Miss Popularity, Miriam, is having a pool party and the girls want to go. But being around water is risky, especially when Zane tosses Cleo into the pool. Lewis is the only one around to help so he finds out their secret.','2007-03-01 12:18:05'),(67571,67545,2,'Rikki, Emma and Cleo discover that sea turtles are being captured by fishing nets. When Rikki and Emma attempt to rescue the turtles by cutting the nets, it causes the fisherman to think that there is a rogue shark roaming their ocean.','2007-03-01 12:18:09'),(67572,67546,2,'Emma decides that she is not going to have her annual sleepover party due to what has happened to them. But Rikki and Cleo try to convince her otherwise. Meanwhile, Lewis conducts experiments on the girls.','2007-03-01 12:18:14'),(67573,67547,2,'Cleo\'s sister Kim finds her diary and thinks that Cleo and her friends are \'evil mermaids\' and she plans to tell everyone. Meanwhile, Lewis goes to Macco Island to find out more about what happened to the girls.','2007-03-01 12:18:18'),(67574,67548,2,'Emma gets into trouble babysitting her little brother Elliot. She goes to Lewis for help when Elliot develops a crush on Rikki.','2007-03-01 12:18:37'),(67575,67549,2,'Miss Chatham gives Cleo a warning that she doesn\'t quite understand. Until Emma finds herself unable to change back from a mermaid under a full moon.','2007-03-01 12:18:40'),(67576,67550,2,'Lewis is offered a great job with a marine biologist, but the girls are concerned that his interest will cause him to reveal too much information','2007-03-01 12:18:43'),(67577,67551,2,'Rikki is offered a job to collect rare fish. At first it seems perfectly fine, until she finds out the person that hired her is selling the fish for large profits.','2007-03-01 12:18:46'),(67578,67552,2,'Rikki enters a short film contest on the theme of \'Heroes\' and decides to capture some nice underwater footage with her \'abilities\'.','2007-03-01 12:18:49'),(67579,67553,2,'Byron asks Emma for help with training the school\'s swimming team and Emma has some trouble deciding whether or not to help out in her current situation. Meanwhile, Lewis continues to experiment on the girls, which annoys Rikki.','2007-03-01 12:18:55'),(67580,67554,2,'The full moon gives Cleo a power to put guys in a \'trance\' and she suddenly gets a rush of admirers.','2007-03-01 12:18:59'),(67581,67555,2,'Emma invites Miss Chathams to stay at her place and Zane overhears Miss Chathams concerning about \'her treasure\'.','2007-03-01 12:19:02'),(67582,67556,2,'Cleo\'s 16th birthday is approaching and she thinks that her father is going to throw another embarrasing birthday party. Meanwhile, Zane tries to find the \'sea monster\' that he saw when he almost drowned.','2007-03-01 12:19:06'),(67583,67557,2,'Emma is doing well at her new job at the JuiceNet cafe, but when she is left in charge, she has trouble managing her new employee, Rikki.','2007-03-01 12:19:09'),(67584,67558,2,'Rumour has it that Cleo has a boyfriend and her friends and family are trying to find out who he is. Meanwhile, Zane continues his search for the \'sea monster\' he saw.','2007-03-01 12:19:13'),(67585,67559,2,'The girls have to fake sick as a result of a thunderstorm, so their secret won\'t be discovered at school. But their \'sickness\' attracts the attention of doctors.','2007-03-01 12:19:16'),(67586,67560,2,'Zane\'s quest to find the \'sea monster\' has led him to Macco Island. Rikki loses control of her powers as a result of the full moon and Zane finds her.','2007-03-01 12:19:21'),(67587,67561,2,'Cleo and her sister Kim is stuck taking care of their cousin Angela and it turns out that she especially enjoys water.','2007-03-01 12:19:24'),(67588,67562,2,'Lewis enters the annual fishing derby. When Cleo sees him struggling, she decides to help him out. But he is caught and accussed of cheating.','2007-03-01 12:19:29'),(67589,67563,2,'Emma decides to change her look by colouring her hair red. Though nothing is that simple when you\'re half-mermaid. Zane asks Rikki out on a date.','2007-03-01 12:19:33'),(67590,67564,2,'Emma and Cleo is concerned about Rikki going out with Zane. They force Rikki to decide to either be with Zane or with them.','2007-03-01 12:19:37'),(67591,67565,2,'Rikki finds a locket that looks the same as Miss Chatham\'s in a Jewellery shop and she is determined to get it.','2007-03-01 12:19:41'),(67592,67566,2,'The school dance is happening soon and Emma and Cleo are hoping that Byron and Lewis will take them.','2007-03-01 12:19:44'),(67593,67567,2,'It\'s time for Emma\'s family\'s annual vacation trip, but she can\'t go as the risks are too high. But all her excuses don\'t go very well with her family. Meanwhile, with the return of Dr. Denman, Zane is closer than ever to cracking the girl\'s secret.','2007-03-01 12:19:48'),(67594,67568,2,'Dr. Denman sets up a trap for the girls at Macco Island and Zane is forced to decide who he should be helping.','2007-03-01 12:19:51'),(67596,67595,2,'John Dorian, \"J.D.\" to friends, is a boyishly handsome, self-deprecatingly funny, likeable guy who would be confident if he only realised his assets. Four years of medical school have prepared J.D. for his first day as an intern at Sacred Heart Hospital — but he has his doubts. As J.D. is thrown into the chaotic world of hospital life, we not only get to see the quirky characters that he encounters, but also hear the humorous commentary of thoughts streaming through J.D.\'s head.\n\nBy J.D.\'s side is his best friend since college, the handsome and confident Chris Turk. As a new surgical intern, Turk struts around with a gregarious and cocky demeanor that hides a terror that he only admits to J.D. Both guys initially have the hots for their attractive fellow intern, Elliot Reid, but J.D. quickly finds out her beauty is only surpassed by her hyper-competitive attitude.\n\nGuiding the interns\' education are those with more medical experience. Dr. Robert \"Bob\" Kelso, Chief of Medicine, wants the interns to think they can count on him. On the other side of the personality spectrum is Dr. Percival \"Perry\" Cox, a steamroller of a man short on patience. Watching over the interns with a caustically teasing but caring demeanor, is nurse Carla Espinosa, a woman who is motherly and sexy at the same time — which appeals mightily to Turk.','2007-03-01 13:01:03'),(67598,67597,2,'J.D. tries to persuade a smoker patient to quit smoking in order to impress Dr. Cox, who is just feeling lonely in his opinion. Elliot\'s attitude towards Carla annoys her, thus Turk is able to go on a date with Carla, when he convinces her to forgive Elliot.','2007-03-01 13:01:09'),(67600,67599,2,'J.D. begins to feel distant from Turk, when he leaves him abandoned every time that he tries to talk to him. Elliot fights with Kelso for calling her \"sweetheart\", and she seeks Dr. Cox\'s advice. J.D.\'s relationship with Elliot goes in a time race, when he has 48 hours to kiss her before he is put into her \"Friend Zone\".','2007-03-01 13:01:15'),(67602,67601,2,'The three interns are each assigned patients with various illnesses. Statistically speaking, one of the three is going to die. J.D.\'s patient is 86 year old Mrs. Tanner, who is in renal failure. 20 year old David Morrison is Turk\'s hernia patient and Elliot\'s patient Mrs. Guerrero only speaks Spanish and might have lupus.','2007-03-01 13:01:21'),(67604,67603,2,'J.D. points out what seems to be a technical mistake to Dr. Kelso, but it was really an attempt of Dr. Cox to save a woman without insurance using a dead guy\'s insurance. Dr. Kelso and Dr. Cox show J.D. their different ways of looking at medicine. Meanwhile, the Janitor intimidates J.D., Elliot discovers the healing powers of her boobs and Turk gives Carla a pen he thought he took from the Lost and Found box.','2007-03-01 13:01:28'),(67606,67605,2,'Dr. Cox is still facing the threat of suspension, and coincidentally, J.D. is assigned to a special patient: Jordan Sullivan, an important board member. She is very demanding and J.D. ends up sleeping with her after he confronts her. Only he didn\'t know that she is Dr. Cox\'s ex-wife, and now the only one who can save J.D.\'s mentor from being fired by the evil Dr. Kelso.\n\r\nMeanwhile, Elliot is assigned to take care of a shrink whose jaw has been wired shut, and for whom she ends up becoming a patient. Carla\'s mom makes a scandal after Turk spends the night at Carla\'s, and when she breaks her leg, Carla blames Turk for it.','2007-03-01 13:01:34'),(67608,67607,2,'J.D. has finally earned the spot as brightest student, but he\'s got competition: Nick Murdoch, who seems to be nicer, friendlier and has a better butt than him. But even J.D. can\'t hate the guy, for he is so nice. But he is surprised when he finds Nick sitting in a corner crying because he can\'t take the pressure of medical internship.\n\r\nMeanwhile, Turk is having problems at the operation table and doesn\'t tell Carla, who keeps bothering Dr. Cox about it. And Dr. Cox gives Turk a very unique suggestion on how to calm down before surgery.','2007-03-01 13:01:40'),(67610,67609,2,'J.D. and Turk become heroes after saving a cameraman\'s life on TV, while heading to a strip club. But Turk quickly becomes the target of a new publicity campaign led by Dr. Kelso, exploiting the hospital\'s diversity.\n\r\nMeanwhile, J.D. worries about his evaluation. Elliot is going out with Carla, but in the last minute she blows her off and later Elliot runs into her in a bar.','2007-03-01 13:01:47'),(67612,67611,2,'J.D. gets to see the hospital through the eyes of a patient when he\'s admitted for appendicitis. Elliot examines him and he tells everyone how cold and rough she is, which drives her crazy. J.D. doesn\'t want Turk to operate on him, which hurts Turk\'s feelings.\n\r\nMeanwhile, Dr. Cox is trying to show off to his mentor, Dr. Benson, the ex-chief of medicine, who is also a patient at the hospital. The only thing in his way is Dr. Kelso, who almost dismissed Dr. Benson prematurely.','2007-03-01 13:01:55'),(67614,67613,2,'J.D. begins a new relationship with Carla. J.D. gains a new nickname - \"Scooter\" - and his relationship with Nurse Carla evolves as he begins to out-distance her medical knowledge, while Turk trembles, when he learns that his secret lunch spot was claimed years ago by the territorial Dr. Kelso.\n\r\nElsewhere, Dr. Cox gives Elliot the evil eye when she won\'t discharge a troublesome patient.','2007-03-01 13:02:02'),(67616,67615,2,'It\'s Christmas, and even though J.D. and the others don\'t really feel like celebrating, Turk makes a huge deal about it. But his faith and happiness are gone after a very busy night at the hospital.\n\r\nDr. Cox has J.D. videotape the birth of the child of one of his friends.','2007-03-01 13:02:08'),(67618,67617,2,'A woman slips and falls on the wet floor of the hospital. Afraid that she might sue the hospital, Dr. Kelso asks J.D. to stand by her and be friendly, so she won\'t sue them. But J.D. is very busy with Dr. Cox\'s 24-hour marathon to keep his ICU patients alive.\n\r\nElliot is desperate for some attention from Dr. Cox. Meanwhile, Turk snaps at Carla when she steals fries from his plate.','2007-03-01 13:02:14'),(67620,67619,2,'J.D. is frustrated when his budding romance with an ex-patient wilts as their dates are constantly interrupted by emergency calls, while the beastly Dr. Kelso becomes less fearsome to the wide-eyed interns, when Dr. Cox informs them how to avoid the blowhard\'s bite. In addition, a perplexed Carla and Turk deal with their first sexual intimacy complication.','2007-03-01 13:02:19'),(67622,67621,2,'Alex and Elliot argue over missing medication, and J.D. needs to choose sides.\n\r\nMeanwhile, Dr. Kelso gives Carla a ride to work and she sees a totally different side of him. Turk develops a conflict with Dr. Cox after he finds out that Dr. Cox has secret feelings for Carla.','2007-03-01 13:02:24'),(67624,67623,2,'After going to bed and spending an entire day having sex, J.D. and Elliot go to work trying to hide their new secret romance, but everybody already knows it.','2007-03-01 13:02:30'),(67626,67625,2,'When a rampaging Dr. Cox suddenly shows up at his door in a strange funk, J.D. sees a possibility of a breakthrough in their relationship - until he learns that Cox loses control in almost an annual rite. Meanwhile, Turk elects to partner with Elliot on a research project so that he can maneuver her back with his buddy J.D., and Carla struggles to fulfill a comatose patient\'s final request - playing heavy metal music in his room.','2007-03-01 13:02:34'),(67628,67627,2,'J.D., Elliot and Turk are receiving their first medical students, and now they finally get a chance to see what it feels like to be on the other side. Turk\'s student is a very attractive young woman, to whom Dr. Cox is immediately attracted. But he doesn\'t know his way around women and needs Turk to give him a little help. J.D. doesn\'t know how to handle his student and Elliot\'s turns out to the be son of an important CEO.','2007-03-01 13:02:39'),(67630,67629,2,'J.D. has a patient who\'s rude to him and the nurses and eventually dies from cancer. J.D. feels awful for not giving him his full attention and worries maybe he could have saved the guy if he was nicer to him.\n\r\nMeanwhile, Elliot is convinced that Dr. Kelso is the one singing a song called \"Tuscaloosa Heart\" on a tape given to her by a patient who claims he went to college with Bob. And Dr. Cox finds himself trapped in a love square: He\'s falling in love with Kristen Murphy, his intern, just as his ex-wife reappears demanding sex – and there\'s also his crush on Carla.','2007-03-01 13:02:45'),(67632,67631,2,'An assortment of moms and dads descend on their offspring at home and in the workplace. J.D.\'s father is a gregarious yet lonely divorcee who\'s desperately trying to be just one of the guys. Elliot\'s folks, on the other hand, are a snooty couple whose pompous behavior dismays their daughter. Similarly rattled is Turk, unnerved by the bonding of his girlfriend, Carla, and his brassy mother. But the most vexatious parent by far is the janitor\'s dad.','2007-03-01 13:02:49'),(67634,67633,2,'Turk\'s competitiveness is starting to annoy J.D., especially when it crosses the line of personal jokes and comes to patient\'s matters.\n\r\nMeanwhile, Dr. Cox finally has a taste of good coffee, but thanks to his feud with Dr. Kelso, the only nurse who was able to make it gets fired. Elliot meets a very attractive patient, whom she instantly identifies, but has a really hard time getting him to ask her out.','2007-03-01 13:02:54'),(67636,67635,2,'J.D. fears being contaminated with Hepatitis B, after a needle accidentally sticks his forearm.\n\r\nMeanwhile, Elliot has a hard time combining her new relationship and keeping up with studies. Turk obsesses about getting in shape, after Carla makes a fat joke about him.','2007-03-01 13:02:59'),(67638,67637,2,'Jordan\'s brother Ben is admitted at Sacred Heart for having an accident with a nail gun. J.D. learns that Ben has leukemia, but won\'t believe it, since there have been many mixups in the hospital lately, so he goes on a search for the real test results.','2007-03-01 13:03:03'),(67640,67639,2,'Ben takes the news of his diagnosis pretty well - at least better than his sister Jordan and J.D. Remarkably, it is Dr. Cox who is the voice of reason and compassion, until his own fears get in the way.\n\r\nMeanwhile, Turk and Elliot have their own issues to deal with. Turk is upset because he wasn\'t chosen to assist on a difficult surgery and Elliot is criticized during rounds by Dr. Kelso for the 100th time.','2007-03-01 13:03:12'),(67642,67641,2,'It\'s J.D.\'s last day as an intern, and soon he will become a resident. Carla and Turk are arguing about dating other people. Elliot finally rebels against being everyone\'s doormat, and J.D. is just trying to stay out of people\'s way.\n\r\nJordan has returned to get a physical and a new patient, Mr. Bober, has been admitted, because he needs his gall bladder removed. He really needs the surgery, but doesn\'t have the insurance to pay for it. They enlist the help of Dr. Cox, Dr. Wen and Jordan. And Jordan spills the beans.','2007-03-01 13:03:18'),(68758,68757,2,'A collection of clips and bloopers from the first two seasons of the hit NBC comedy.','2007-03-01 17:07:44'),(68772,68771,2,'Relationships between the staff of Sacred Heart Hospital have been shaken since Jordan\'s revelations. Turk is sleeping on J.D.\'s bed, after Carla kicked him out of his own. Elliot is having a hard time facing J.D. every day at work. J.D. desperately tries to get Dr. Cox\'s attention back, unsuccessfully.','2007-03-01 17:07:57'),(68792,68791,2,'J.D., Elliot and Turk find themselves alone in the hospital night shift and face responsibilities without supervision for the first time. Luckily, they have Carla there to support and guide them through the night.\n\r\nMeanwhile, Dr. Cox doesn\'t know what to do, when he realizes that he has feelings for his ex-wife Jordan and is asked (forced actually) to introduce Dr. Kelso at a social event, where he will be receiving an award from the medical board.','2007-03-01 17:08:02'),(68816,68815,2,'When Dr. Kelso challenges the residents by offering a trip to a medical conference in Reno as a reward to the individual, who presents the most interesting case study, J.D. refuses to play along, earning him the respect of Dr. Cox.\n\r\nIn the meantime, Turk misses his opportunity to ask for a new laser on the one day of the year, that Dr. Kelso grants favors, so he is forced to find another way to come up with the goods.','2007-03-01 17:08:08'),(68838,68837,2,'J.D. insists that Carla should open up to him. When she finally starts to do that, J.D. screws it up by telling Turk. Elliot is desperate for attention from Dr. Cox. Turk sees himself in an ethical dilemma when Dr. Kelso picks him over a female surgeon to spend a weekend in Mexico.','2007-03-01 17:08:14'),(68860,68859,2,'Elliot sleeps with a handsome doctor she hardly knew and soon becomes the hospital tramp. Turk suffers from his back after operating with Dr. Amato, a very short surgeon. J.D. finds out that wearing a white coat doesn\'t make him a better doctor, but is upset by having Dr. Cox throw in his face that he made another mistake. And Dr. Kelso is just dying for an opportunity to lash out his anger on Dr. Cox.','2007-03-01 17:08:19'),(68891,68890,2,'J.D.\'s brother is in town. Turk is thrown out of a patient\'s funeral for not knowing his name and feels even worse because earlier he made a bet with Dr. Cox over another patient\'s life.','2007-03-01 17:08:25'),(68916,68915,2,'All of the male doctors are euphoric due to the visit of Julie Keaton, the pharmaceutical sales rep, except for Dr. Cox, who still believes in treating patients for their best health, instead of trying to get some attention from the hot Ms. Keaton.\n\r\nMeanwhile, J.D. and Elliot argue over a risky decision regarding one of Elliot\'s patients. Turk tries to talk Carla into entering a practitioner nurse course, so she won\'t be so underestimated by the doctor\'s staff.','2007-03-01 17:08:30'),(68934,68933,2,'When an expectant Jordan shows up unexpectedly, Cox is forced to choose between her and his new love, Julie.\n\r\nMeanwhile, J.D. and Turk take advantage of the hospital\'s supply closet for sleep, when they take on extra shifts at a free clinic to supplement their income. Carla encourages Elliot to stand up to her father, when he pressures her to pick a specialty more \"suitable for a woman\".','2007-03-01 17:08:36'),(68956,68955,2,'Ever since her father cut her off financially, Elliot\'s been feeling the weight of the world on her back. While having to find a new affordable place to live, she also has to face the threat of being sued by a patient whom she told he had only eight months to live. Carla and Jordan hit a sore spot when Carla gives her opinion on Jordan and Perry\'s relationship.\n\r\nMeanwhile, J.D. has a fight with Dr. Cox and the two dispute over who gets to give the better treatment to two patients with the same prognosis.','2007-03-01 17:08:42'),(68984,68983,2,'Elliot still doesn\'t have a place to live. J.D. think he\'s lost his mojo when he can\'t even kiss the giftshop girl while they go out on a date. Turk and Carla are having romance problems, because she feels he\'s not being as generous to her as she is to him. And Dr. Cox freaks out when he lets Jordan move in to his place due to her pregnancy.','2007-03-01 17:08:49'),(69008,69007,2,'Renewed sex with J.D. calms Elliot, who\'s facing personal and professional dilemmas: She\'s broke, and patients are bailing out on her.','2007-03-01 17:08:56'),(69029,69028,2,'Comeuppances are in store for Dr. Cox, Dr. Kelso and J.D. from a hypochondriac, a surgical patient and Elliot, who wants more than just sex from J.D.','2007-03-01 17:09:03'),(69057,69056,2,'J.D. bonds with a patient, who is waiting for a heart transplant and discusses with her their idea of what death must be like. Elliot puts her foot down and demands a feminine locker room from Dr. Kelso. Turk decides it\'s time to propose to Carla, but a kid swallows the engagement ring.','2007-03-01 17:09:10'),(69087,69086,2,'Turk is still waiting for Carla to answer his proposal and asks his brother to stay over a few days to help him deal with it. Dr. Townshend, an old friend of Dr. Kelso and one of the nicest doctors around befriends J.D.\n\r\nElliot accidentally finds out the sex of Jordan\'s baby, becoming the object of Dr. Cox\'s anxiety.','2007-03-01 17:09:18'),(69113,69112,2,'Elliot meets a nice guy at the bar, but freaks out when she finds out he\'s a male nurse at Sacred Heart. Turk keeps asking Carla to marry him, but she still won\'t give an answer. Dr. Cox feels the pressure he puts on himself everyday: His psychiatrist, his subordination to Dr. Kelso and his paternal feelings for J.D.','2007-03-01 17:09:25'),(69139,69138,2,'J.D. and Turk think they\'ve got bad karma after hitting a car and causing an accident, while playing golf on the hospital roof. Dr. Cox bends over backwards to give Jordan as much comfort as possible on her labor day, and she confesses to J.D. that Dr. Cox is the real father. Elliot seeks advice from Carla on how to tell Paul that she\'s crazy, because they\'re getting more intimate and she can\'t hide it anymore. But Carla is feeling too crazy herself with the upcoming wedding.','2007-03-01 17:09:36'),(69163,69162,2,'A personal secret of Dr. Cox is revealed during hospital visitations by a cocky MD (Jay Mohr), who establishes a rapport with J.D.','2007-03-01 17:09:42'),(69193,69192,2,'J.D. flirts with the wife of a patient who\'s been in a coma for the past two years, whom they all call T.C.W. (Tasty Coma Wife). He feels guilty for doing that, even though she wants to go ahead with it. Meanwhile, he can\'t stand listening to any more relationship problems, as everybody dumps their issues on his ears: Elliot, sabotaging her relationship with Paul over beef jerky, Carla, finding out her engagement ring passed through a patient\'s digestive system and Dr. Cox\'s unsucessful attempts to get some attention from Jordan, who can only think about her baby right now.','2007-03-01 17:09:48'),(69220,69219,2,'Turk takes J.D. up to surgery, and right from the start J.D. steps all over Turk when trying not to be the geek among the surgeons. Paul hears Elliot say \"I love U2\" while she was rearranging her CDs and thinks she said \"I love you too\". Dr. Cox decides to get even with Dr. Kelso by telling everyone he\'s dead, revealing what people really think of him.','2007-03-01 17:10:06'),(69252,69251,2,'Jamie\'s (T.C.W.) husband died, and J.D. struggles with the ethical issues involved in starting a relationship with her. Dr. Cox babysits his son, whom Jordan still hasn\'t chosen a name for, and is disturbed that he feels nothing for the baby. Turk is haunted by erotic dreams about Elliot, which gets him into hot water with Carla.','2007-03-01 17:10:14'),(69277,69276,2,'J.D. carries on with his romance with Jamie, but finds himself at a dead end after realizing she\'s a drama queen. Dr. Kelso makes Dr. Cox give a class on how to approach the patients nicely in order to prevent possible law suits. Carla\'s mother dies and she wants to get married.','2007-03-01 17:10:21'),(69303,69302,2,'J.D. and Turk\'s college buddy Spence drops by for a visit, and accidentally tells Dr. Cox a secret. Too much partying with successful Spence causes Turk and J.D. to show up late and drunk for work, which Dr. Kelso fully reprehends them for. Elliot\'s feeling low since she can\'t measure up to Dr. Kelso\'s standards, and the Janitor starts another feud – this time over paychecks – with J.D.','2007-03-01 17:10:32'),(69330,69329,2,'A run-in with her old flame Sean and an accident in her new car lead Elliot to the realization that nothing good has happened to her in the three years that she has been at Sacred Heart. This realization drives her to take drastic measures, including a complete makeover, both inside and out, in an attempt to change her luck.\n\r\nMeanwhile, J.D. gets stuck with a patient, whose diagnosis he can\'t quite pin down, and when Dr. Cox denies him any assistance, he looks to Carla and Turk to help him out. While Dr. Cox is busy not helping J.D., he takes the time to make amends with Dr. Kelso.','2007-03-01 17:10:47'),(69362,69361,2,'J.D. is feeling left out of his friendship with Turk and gets hurt when Turk is scared of opening up to him.\n\r\nMeanwhile, Carla is driven crazy over an unidentified urine sample, and Elliot tries to balance Sean and her career, so that one doesn\'t end up getting in the way of the other.','2007-03-01 17:10:55'),(69392,69391,2,'Finding difficulties training his interns, J.D. asks to Elliot for some help. She tells J.D. about Sean, who gave Elliot great tips based on his dolphin training that fit perfectly for her interns.\n\r\nDr. Cox finds the ideal pediatrician for his son: Dr. Norris, who acts and looks just like him. However, Dr. Cox is quick to find a problem with him once Jack develops a cough that scares both him and Jordan.','2007-03-01 17:11:03'),(69428,69427,2,'Sean is a bit surprised and disturbed to learn about Elliot and J.D.\'s history together, but it turns out his anger is really a cover up for his upcoming six month long trip and he doesn\'t want Elliot to explode.\n\r\nDr. Cox. is forced to swallow his pride and actually ask for help when he decides to throw his hat in the ring for the Residency Director position at the hospital.\n\r\nCarla picks up an extra shift as a surgical nurse, which allows her to spend the day working alongside with Turk, to his great annoyance.','2007-03-01 17:11:08'),(69460,69459,2,'Dan decides to stay with J.D. for a while after their mom\'s new fiancee kicks him out, but after spending some quality time with him at the hospital, Dan isn\'t sure if he likes the cynical person his little brother has become.\n\r\nElliot tries to deal with her own problems of a long distance relationship and decides to try moonlighting as a pet examiner with Carla to save up money.','2007-03-01 17:11:13'),(69478,69477,2,'A chance meeting in the elevator sparks a new friendship between J.D. and the mysterious Danni whose ongoing dialogue about her ex forces J.D. to talk about his feelings for Elliot.\n\r\nCarla\'s brother Marco comes to visit, but he still hasn\'t forgiven Turk for mistaking him for a valet at their mother\'s funeral. Unfortunately, Turk can\'t even apologize because Marco can\'t speak anything but Spanish.\n\r\nAt the hospital, Dr. Cox relishes his new job promotion but is surprised when J.D. doesn\'t follow his lead in contradicting Dr. Kelso\'s orders.','2007-03-01 17:11:20'),(69498,69497,2,'As J.D.\'s relationship with Danni progresses, he and Dr. Cox are forced to spend more time together outside of the hospital, to Perry\'s great chagrin.\n\r\nMeanwhile, as they each deal with problems in their own relationships, Carla and Elliot work to find their own balance between their personal and professional relationships.\n\r\nDr. Kelso accidentally punctures his eardrums giving the hospital staff an opportunity to tell him how they truly feel about him.','2007-03-01 17:11:26'),(69515,69514,2,'Turk is happy that he finally makes it through a solo surgery without the assistance of an attending surgeon.\n\r\nDr. Cox dreads the fact that he is getting older.\n\r\nJ.D. also makes a discovery as he finds out that many of the hospital staff don\'t know the Janitor as he does.','2007-03-01 17:11:32'),(69534,69533,2,'Elliot is feeling uncomfortable using clinical terms for her patient\'s private parts – a result of a repressed childhood and an accidental orgasm she inflicted on a patient during a pelvic exam - so Carla tries to teach her how to say \"vagina\" and \"penis\" without blushing.\n\r\nMeanwhile, Dr. Cox crashes at J.D. and Turk\'s after taking bad advice from J.D. Carla suggests no more sex until the wedding and Turk only comes to terms with it after learning the real meaning of romance from a patient with prostate cancer. Ultimately Carla backs down on her own idea when she has a stressful day at work finally letting people make fun of her.','2007-03-01 17:11:37'),(69558,69557,2,'Carla and Elliot try to help a patient, Maggie, lose her virginity as she prepares to die.\n\r\nWalking in on her sister and Dr. Cox prompts Danni to move in with J.D. Dr. Cox attempts to convince Turk to do a kidney transplant for a patient he has \"moved up\" the list. But a personal grudge seems to stand in the way and may decide whether the patient lives or dies.','2007-03-01 17:11:42'),(69588,69587,2,'J.D. tries to break-up with Danni, but she beats him to it when she realizes that she will always be second place to Elliot in his heart.\n\r\nDr. Cox suddenly becomes a nice guy and Elliot changes back to her old self after Dr. Kelso criticizes her new look.','2007-03-01 17:11:49'),(69606,69605,2,'J.D. believes, he may have finally found a mentor in Dr. Kevin Casey, a surgeon with obsessive-compulsive disorder, and it turns out, that Dr. Cox has always been jealous of the guy.\n\r\nMeanwhile, the Janitor and his new assistant help Kelso out with a garbage problem.','2007-03-01 17:11:58'),(69626,69625,2,'Elliot finds herself perplexed over a simple procedure that leaves her questioning her career path. She goes to seek Dr. Kevin Casey\'s advice but becomes frustrated when she learns that the epiphany toilet, which the Janitor secretly installed on the roof, is getting more attention than she is.\n\r\nMeanwhile, Turk asks J.D. to be his best man at his wedding, which sends J.D. into sheer bliss momentarily until he hears a phone message that makes him question his friendship with Turk.','2007-03-01 17:12:04'),(69653,69652,2,'Jordan\'s brother and sister return, but Dr. Cox learns that his brother-in-law Ben hasn\'t visited a doctor about his cancer in the two years he has been gone traveling the world.','2007-03-01 17:12:11'),(69677,69676,2,'Jordan\'s friends Allison and Maddie come to town to provide moral support for Jordan after her brother\'s death – however, their constant presence does not provide any relief to Dr. Cox.\n\r\nMeanwhile, Turk tries to impress the new female surgeon, Dr. Miller, but his first encounter serves only to leave him baffled by the opposite sex yet again. Attempting to reinforce the policy on sexual harassment at Sacred Heart, Carla is forced to teach a course where Dr. Kelso is the number-one student.','2007-03-01 17:12:20'),(69702,69701,2,'An ever present butterfly prompts the question on what could have happened different as Turk looks for his lucky do-rag for surgery, and Elliot tries to find a lost stuffed animal for a child needing a bone marrow transplant.','2007-03-01 17:12:26'),(69729,69728,2,'J.D. must keep a secret when Carla\'s \"what-if\" guy asks her out on a date.\n\r\nMeanwhile, on the other side of the argument, Carla hounds Turk for checking out other women.\n\r\nElliot is also on the spot as Dr. Cox and Dr. Kelso both advise her not to give her patient drugs as they suspect he is an addict faking pain.','2007-03-01 17:12:34'),(69751,69750,2,'Turk has to confront a young patient of his, when he accidentally cuts a nerve and the boy (who happens to be a concert pianist) loses use of one of his hands.\n\r\nMeanwhile, one of Elliot\'s patients unintentionally teaches her a lesson about her relationship with J.D.','2007-03-01 17:12:42'),(69777,69776,2,'J.D. hooks up with Danni again, after Sean returns, but he can\'t forget about his passionate night with Elliot.\n\r\nMeanwhile, Dr. Cox realizes, that he might actually have a crush on the one doctor he loathes.','2007-03-01 17:12:49'),(69802,69801,2,'Elliot asks Sean to move in with her, which only adds to J.D.\'s problems.\n\r\nTurk is unsure why Dr. Miller\'s attitude towards him has changed, until he finds out that Carla un-invited her from their wedding.\n\r\nDr. Kelso outrages Dr. Cox when he announces that Sacred Heart will begin doing full body scans, starting with an ever present hypochondriac patient, who wants any freebies he can get.','2007-03-01 17:12:54'),(69833,69832,2,'J.D. is unsure what to do, when he realizes he made a mistake telling Elliot he loved her.\n\r\nThe Janitor squares off against Dr. Cox after he loses the election of the janitors to Randall.\n\r\nCarla\'s brother Marc constantly puts Turk in a tough situation, when Turk forgets to write his wedding vows.','2007-03-01 17:13:03'),(69861,69860,2,'The big day for Turk and Carla has finally arrived, but a patient holds up Turk.\n\r\nWith Elliot still angry at him, J.D. attempts to reconcile her with Sean as a way to make everything right again in their friendship.','2007-03-01 17:13:10'),(69925,69924,2,'Dr. Clock tries to reconcile J.D. and Eliot, while waiting to see which one Dr. Cox will give the Chief Resident position to. Molly and Carla are experiencing some subtle conflict and Elliot and J.D. begin to come together after long boughts of conflict of their own.\n\r\nMeanwhile, Dr. Cox, Turk and the Janitor are forced to work together to help a patient.','2007-03-01 17:13:25'),(69958,69957,2,'Dr. Cox is having issues with Jordan, since Ted revealed that they are still technically married due to some filing problems.\n\r\nJ.D. has problems of his own as he can\'t shake off the tag of Co-Chief Resident the Janitor assigned to him, while Elliot keeps the Chief Resident tag.\n\r\nElsewhere, Turk begins to doubt his abilities after letting a patient die and isn\'t helped, when he finds out J.D. has no confidence in him either.\n\r\nDr. Cox and Molly spar about her involvement in his patients.','2007-03-01 17:13:34'),(69985,69984,2,'J.D. is shocked to hear Dr. Cox tell his interns that eventually, they will screw up and kill a patient. J.D. fears his first time killing someone will soon be upon him.\n\r\nElliot is upset with Molly, after she disagrees about a patient\'s promise to attend drug rehab.\n\r\nCarla loses Rowdy and she and the Janitor go looking for him.','2007-03-01 17:13:44'),(70008,70007,2,'Elliot becomes unsure, if she wants Molly as her mentor, when she finds out that Molly doesn\'t have a perfect home life.\n\r\nJ.D. is tested in leadership skills when Dr. Cox yells at him in front of his interns.\n\r\nCarla and Turk try to come to an agreement when Turk continuously wakes Carla up every night.','2007-03-01 17:13:55'),(70033,70032,2,'When Dan resurfaces, J.D. is shocked to learn his father has passed away. The reactions from his co-workers help J.D. a little, but the one person, Dr. Cox, who he wanted to be there for him is too busy with J.D.\'s patients.\n\r\nMeanwhile, Dan sits drunk in the bath tub the whole day and Turk finds out he has Type II Diabetes.','2007-03-01 17:14:06'),(70056,70055,2,'When J.D. finds Dan with Elliot, Turk tells him to use the hurt brother excuse to get them to break up, just like Turk uses his diabetes to get stuff from Carla. But then J.D. realizes he wasn\'t hurt at all...\n\r\nDr. Cox and Dr. Kelso unite to try and torment their common enemy: Dr. Clock.','2007-03-01 17:14:13'),(70075,70074,2,'When Molly takes a job at a different city, she and J.D. end up having a night of kissing, and he tries to rush to sleep with her before she leaves.\n\r\nDr. Cox goes on ambulance duty with a maniac, who he eventually finds out is a woman who has lost her son to an accident.','2007-03-01 17:14:21'),(70094,70093,2,'J.D. is approached by a malpractice attorney, asking him to do a risky procedure on her father.\n\r\nMeanwhile, Elliot guides Doug to a new career path and Turk struggles to avoid a hypochondriac patient.','2007-03-01 17:14:28'),(70118,70117,2,'With the case against Turk on his mind, J.D. attempts to end it with Neena, but she won\'t take \"no\" for an answer and keeps him wrapped around her finger. Carla tries her own way of persuading Mr. Corman to drop the lawsuit.\n\r\nElliot sets out to prove she isn\'t the doctor she was four years ago and doesn\'t need to rely on anyone anymore.','2007-03-01 17:14:36'),(70144,70143,2,'J.D. takes matters into his own hands, when searching for a relative for his favorite patient.\n\r\nMeanwhile, Elliot is fed up with coworkers not taking her serious and discovers, that she can get her way by flaunting her femininity with some help from Carla and Jordan.','2007-03-01 17:14:43'),(70179,70178,2,'When J.D. has to address a bunch of pre-med students about what it\'s like to be a doctor, he strays off the beaten path and chooses to discuss his best moments as a doctor instead. When he challenges the rest of the staff to do so, they all remember their best memories in the medical field.\n\r\nMeanwhile, Elliot is forced to face her fear of children, when she must befriend a ten year old boy, whose father is being treated in the I.C.U.','2007-03-01 17:14:49'),(70203,70202,2,'Elliot starts showing J.D. up as the calmer, more competent doctor. A date with the Janitor leads to an a capella sing-off between his \"group\" and Ted\'s band.\n\r\nTurk starts taking his diabetes more serious, when he realizes the dire consequences of the disease.','2007-03-01 17:15:54'),(70232,70231,2,'A man injured in a bar fight teaches Turk and J.D. a lesson about living life to the fullest.','2007-03-01 17:16:00'),(70258,70257,2,'J.D. has a crush on a girl who he met at a club, and he\'s torn about telling her that her boyfriend has gonorrhea.\n\r\nElliot decides to take a stand against Dr. Kelso with one of her patients. And Dr. Cox is blackmailed by the Janitor for a basketball game\'s score, after he spoils the end of \"The Sixth Sense.\"','2007-03-01 17:16:06'),(70287,70286,2,'Dr. Kelso dons scrubs to prove a point to Dr. Cox, only to watch it backfire, when an obnoxious patient refuses to listen to him.\n\r\nJ.D. and Turk party, while Carla struggles to find solace in Elliot.','2007-03-01 17:17:08'),(70314,70313,2,'When Carla and J.D. go out to let Carla have some fun, they get drunk and end up accidentally kissing.\n\r\nDr. Cox gets the hammer dropped by Jordan, when Jack has to get stitches under Perry\'s watch.\n\r\nElliot has trouble with a male patient, who has taken enhancement pills.','2007-03-01 17:17:15'),(70335,70334,2,'J.D. and Carla get the silent treatment from Turk, who can\'t seem to control his emotions, after learning about their kiss.\n\r\nDr. Cox reluctantly seeks the help of Elliot, when an epileptic patient won\'t listen to him.\n\r\nThe Janitor feels emasculated by his new uniform.\n\r\nJordan trys Botox.','2007-03-01 17:17:22'),(70358,70357,2,'Turk won\'t open up at couples therapy.\n\r\nElliot refuses Dr. Cox\'s romantic advice, when a very attractive man saunters into the hospital.\n\r\nJ.D. learns a lesson in humanity from a dying old woman.\n\r\nThe Janitor accidently lets a bunch of rats run around Sacred Heart.','2007-03-01 17:17:27'),(70382,70381,2,'Elliot is torn between moving too quickly and ruining her new relationship with Jake.\n\r\nDr. Cox teaches Turk about having a healthy ego and Dr. Kelso and the Janitor fight over who gets to use the motorized cart.','2007-03-01 17:17:35'),(70400,70399,2,'With their residencies over, there are big changes at Sacred Heart. J.D. moves out to live on his own, while Turk and Carla consider a family change, creating another rift in their long friendship.\n\r\nJordan is hired to handle some paperwork for Kelso, which annoys Cox.\n\r\nElliot has a job interview at a different hospital thanks to her boyfriend Jake.','2007-03-01 17:17:42'),(70426,70282,2,'J.D. tries to impress Kylie by paying a hobo in the hospital to fake a heart attack, when everything becomes boring due to a quarantine that he caused.\n\r\nTurk learns, that Carla dated Cox and gets mad at her for not telling him.\n\r\nThe Janitor makes a bet with Dr. Kelso, who is starving, that will make him pay $700, unless the Janitor is able to get a \"face cake\", in order to satisfy him, from Laverne.\n\r\nAlso, Danni Sullivan returns to annoy everyone, causing a constant fight between Ted and Doug.','2007-03-01 17:49:18'),(70447,70283,2,'When J.D. meets a former writer from his all time favorite TV show \"Cheers\", he begins to picture his life at the hospital as a bland, multiple camera sitcom, where everything is perfect and wraps up nicely.\n\r\nBack in reality, Cox is relunctant to fire an amiable cafeteria worker, while Turk and Carla struggle to keep their promise of constant romantic affection afloat.','2007-03-01 17:54:31'),(70468,70284,2,'J.D. is thrown out of the apartment.\n\r\nTurk and Carla continue to struggle to keep the romance alive.\n\r\nDr. Cox has reason to believe that the son of an old buddy is autistic.','2007-03-01 17:54:36'),(70486,70285,2,'J.D. ditches a seemingly uninterested Kylie for Dr. Molly Clock, who just returned from Milwaukee.\n\r\nCarla fumes over Turk\'s frequent phone calls to an ex-girlfriend.\n\r\nThe Janitor and Dr. Cox make a wager over Elliot.','2007-03-01 17:54:41'),(70505,70504,2,'Attending at Sacred Heart, J.D. now has to deal with his own interns.\n\r\nTurk has doubts having children, then tries to prevent Carla from getting pregnant.\n\r\nElliot struggles to find her way at County Hospital and doesn\'t want to seem like the helpless person she was before.','2007-03-01 18:10:32'),(70540,70539,2,'J.D. wants to show Dr. Cox and Dr. Kelso how to treat interns, but instead he finds out that they laugh at his bad jokes out of fear and respect.\n\r\nEveryone at the hospital is avoiding Jordan to get rid of her except for Turk. An aborted attempt to bond with her results in Jordan being conned by Sam, the drug addict.\n\r\nElliot\'s fellowship goes sour and she finds herself confiding in loose-lipped Carla.','2007-03-01 18:11:22'),(70576,70575,2,'While planning his birthday, J.D. finds a list of things he wanted to accomplish, before he turned 30. He enters a triathlon to begin.\n\r\nElliot discovers a side of her boyfriend Jake, that freaks her out.\n\r\nTurk is working hard to impress his bosses and takes on a patient, who wants to be hypnotized during surgery, rather than using anesthesia, all in effort to be promoted.','2007-03-01 18:11:30'),(70604,70603,2,'J.D. is asked to introduce Dr. Kelso at an awards dinner, so he wants to find out something good about him.\n\r\nDr. Kelso and Dr. Cox each have a patient, whom they feel deserves the benefit of a new experimental treatment, but there is only one open slot.\n\r\nCarla and Turk try to help Elliot get her old job at Sacred Heart back.\n\r\nThe Janitor taunts J.D. with the made up game of \"Jiggly Ball\".','2007-03-01 18:11:38'),(70628,70627,2,'Dr. Cox\'s religious sister Paige comes to visit for her nephew\'s baptism.\n\r\nTurk is finding out, just how unsexy baby making can be. Elliot helps him realize that Carla finds the whole process to be romantic.\n\r\nJ.D. and the Janitor start a buddy friendship.','2007-03-01 18:11:45'),(70651,70650,2,'J.D. mistakes an elderly woman\'s happiness as her wish to stop treatment for a fatal illness.\n\r\nTurk and Elliot struggle to find the cause of a patient\'s body pain and Carla tries to organize the annual group photo.','2007-03-01 18:11:52'),(70694,70693,2,'In a \"Wizard of Oz\" homage, J.D. is trying to go home, Turk searches for a heart donor and Carla worries, that she doesn\'t have the courage to become a parent.\n\r\nMeanwhile, Elliot doesn\'t believe, that she has the brains to lead a question and answer session.\n\r\nThe Janitor is painting color coded lines throughout the hospital for easier navigation.','2007-03-01 18:12:01'),(70718,70717,2,'J.D., Turk, Elliot and Carla are interrogated about the mysterious death of a patient.\n\r\nDr. Kelso learns, that J.D. and Turk were away tracking down a patient, Elliot was traumatized over finding out that her make-out buddy was married and Carla was busy recruiting hospital personnel for a group lottery purchase.','2007-03-01 18:12:11'),(70749,70748,2,'J.D. meets the klutzy Julie, and when he becomes smitten, Elliot attempts to help out with romance advice.\n\r\nCarla tries to find Dr. Cox\'s soft side, when he refuses to kiss his son.\n\r\nTurk and the Janitor put together an air band to win a contest, but Kelso gives them a tremendous obstacle.','2007-03-01 18:12:18'),(70773,70772,2,'J.D. is annoyed that Julie doesn\'t laugh, so Elliot encourages him to tell her his feelings and Turk tries to use psychology to fix the issue. Meanwhile, Carla is upset when the Janitor refers to a new nurse as a \"hot young Carla\", which intensifies her growing concern that she is too old to conceive.','2007-03-01 18:12:26'),(70803,67519,2,'J.D. is still dealing with his recent breakup and trying not to kill intern Keith, who has become annoyingly perfect. To make matters worse, a favorite patient is in a serious coma and each of the staff finds their own way to deal with it.\n\r\nDr. Cox and the Janitor bond over drinks at the bar and Carla makes it her mission to make the hospital\'s gym female friendly.\n\r\nMeanwhile Turk suggests, that J.D. and Elliot find themselves \'booty calls\'.','2007-03-01 18:12:32'),(70835,70833,2,'J.D. and Dr. Cox go through the five stages of grief with their favorite patient, who is declining in health.\n\r\nCarla forces Turk to go on a string of double dates, including Elliot and her booty call Keith.\n\r\nDr. Kelso hits Ted with his car, thus Ted finally has the upper hand with a potential lawsuit.','2007-03-01 18:13:24'),(70855,67515,2,'J.D. is sick of perfect intern Keith, and he\'s not the only one.\n\r\nElliot\'s relationship with Keith is revealed, so the other interns think, he is getting special attention.\n\r\nDr. Cox boasts about being named \"The Best Doctor in the City\" by a local magazine, thus Dr. Kelso assigns him to the most difficult patient in the hospital, to deflate his ego.\n\r\nTurk and Carla continue to struggle in their quest for conception.','2007-03-01 18:13:30'),(70874,70873,2,'J.D. urges Cox and his fellow doctors to do special, unconventional things for their patients, but J.D. himself is not sure he can shave his head for a woman undergoing chemotherapy, after meeting a woman who loves his hair.\n\r\nTurk and Carla attempt to eliminate all the stress in their lives, to better their chances of conceiving, but Turk has to compete for a surgical resident spot, and Carla loses Dr. Kelso\'s VIP patient.\n\r\nElliot can\'t stop giving her new boyfriend Keith stupid gifts.','2007-03-01 18:13:39'),(70906,70905,2,'Turk finds out, that Carla is pregnant, before she does, so J.D. convinces Turk to tell the entire hospital staff to surprise Carla with the news. But Carla wants to personally share her baby news with everybody, so Turk and J.D. have to quickly contain the hospital gossip.\n\r\nJ.D. also tricks the Janitor into swallowing a tiny GPS tracking device.\n\r\nMeanwhile, when Elliot puts Dr. Cox into an embarrassing situation, he decides to get even with Elliot through Keith and Carla.','2007-03-01 18:13:47'),(70935,70934,2,'When J.D. rearranges his schedule to allow himself more time to spend with Turk, Turk secretly resents hanging out with J.D. in that time because it interferes with his own \"Turk Time\".\n\r\nMeanwhile, Dr. Cox and Jordan go on a double date with Elliot and Keith, and Carla covers for Kelso at work, as he grieves for his dead dog.\n\r\nLater, a patient almost dies, after giving up part of his liver for his brother, and the hospital staff learns about making sacrifices for the people they really care about.','2007-03-01 18:13:55'),(70966,70965,2,'J.D.\'s brother Dan returns for a surprise visit, and Elliot learns, that J.D. has been telling Dan, that she still likes him.\n\r\nCarla and Turk freak out, when they begin to discuss baby names.\n\r\nDr. Kelso assigns Dr. Cox to assist Ted with malpractice claim paperwork, after Dr. Cox insults Dr. Kelso\'s son.\n\r\nMeanwhile, a patient with weight-related problems needs an MRI, but he\'s too big for the machine.','2007-03-01 18:14:01'),(70992,70991,2,'Turk and Carla turn J.D.\'s old bedroom into a nursery for the baby.\n\r\nThe Janitor seizes an opportunity to shove J.D. out of the picture for a day.\n\r\nElliot uses her mother to learn information about Keith\'s peers.\n\r\nTurk accuses Dr. Cox of not being hip, and Perry accuses him of the very same thing.','2007-03-01 18:14:09'),(71018,71017,2,'J.D. asks Dr. Cox out for lunch, but runs into annoying former patient Jill Tracy, who unexpectedly teaches him something about responsibility.\n\r\nElliot and Carla discover, that Todd has been lying about all his hospital \"conquests\" and suspect that he\'s been less than truthful about other issues. Turk warns them not to meddle in his affairs.','2007-03-01 18:14:15'),(71051,71050,2,'Dr. Cox starts drinking, after his decisions result in the death of three of his patients. The staff tries to cover for him at the hospital, while everyone tries to convince him how inspiring he is for them.\n\r\nTurk starts his new rotation with orthopedic surgery, but isn\'t so fond of his attending doctor\'s touchy-feely methods. Thus, J.D. and the Janitor attempt to help Turk find ways to bond with his new supervisor.','2007-03-01 18:14:21'),(71088,71087,2,'J.D. feels that the same things happen over and over again at the hospital. Dr. Cox returns to work, but Elliot believes that he has lost his usual confidence. Elliot calls Dr. Cox on his behavior. Carla gets fed up with Turk, because he still can do a lot of stuff, but she can\'t since she is now pregnant.','2007-03-01 18:14:30'),(71116,71115,2,'J.D. challenges an urologist\'s assessment on a consult for a patient in need of a risky surgical procedure. He also starts to fall for her.\n\r\nElliot considers breaking up with Keith, but Carla is showing extreme hormonal changes and tries to interfere.\n\r\nThe Janitor and Dr. Kelso are having a little tiff of their own about fear.','2007-03-01 18:14:40'),(71145,71144,2,'J.D. plans a date with Dr. Kim Briggs on their night off, but Elliot keeps getting in their way.\n\r\nMeanwhile, Elliot throws a baby shower for Carla.\n\r\nPerry and Jordan hand over all of Jack\'s stuff to Carla.','2007-03-01 18:14:49'),(71191,71190,2,'J.D. and Kim start contemplating about their future and their baby\'s future. Turk rushes Carla to the hospital, after she goes into labor. Jordan accuses Dr. Cox of not being a more defensive father towards Jack.','2007-03-01 18:15:13'),(71210,71209,2,'J.D. and Kim are surprised of how much they have in common. Recently giving birth, Carla doesn\'t want to return to work. Elliot tries to persuade Dr. Turner, a surgeon with thirty years of experience, that medicine is the better option to work with and that surgery could kill him.','2007-03-01 18:15:22'),(71228,71227,2,'Dr. Cox feels like the TV character <i>House</i> when he has to solve several mysteries, one of them being Elliot\'s anger towards Dr. Kelso, while for some reason she is taking it out on Turk. J.D. tries to be a better boyfriend to Kim.','2007-03-01 18:15:33'),(71245,71244,2,'Elliot begins enjoying luxuries since she has extra money with her new private practice gig. But eventually, J.D. becomes jealous of her and that forbids him the use of these privileges.\n\r\nDr. Cox and the Janitor become roommates in one of the hospital suites, while Turk tries to convince Carla that she has postpartum depression and that she needs help.','2007-03-01 18:15:40'),(71356,71355,2,'A memory loss patient is the peg for a look back on the last seasons of <i>Scrubs</i>, when the Sacred Heart crew looks back at their memorable moments.','2007-03-01 18:16:46'),(71365,71364,2,'TBA','2007-03-01 18:16:54'),(71372,67517,2,'Dr. Kelso is outraged, when he discovers, that a bird has been living in Sacred Heart. He orders the Janitor to dispose of it immediately. However, the Janitor likes the bird so much, he secretly keeps it as a pet.\n\r\nJ.D., annoyed with Keith, tries to get his intern fired, but things don\'t turn out as intended.','2007-03-01 18:21:24'),(71852,71851,2,'Denise is thrilled to be contacted by an old flame, until she discovers that he is interested only in her helping him find a new love. Meanwhile, after Clea confesses the failure of her 9-year marriage, the staff determines to help her with her love life.','2007-03-01 18:46:18'),(71889,71888,2,'Denise and Francine work together to help Clea get over her soon-to-be ex-husband Daniel as she finalizes the sale of their former apartment.  But they disagree on what to do when they discover that Daniel\'s new fiance is having an affair with another man.  Meanwhile, Barry develops a crush on a new client, who is unfortunately interested in only one thing.','2007-03-01 18:46:24'),(71913,71912,2,'Denise repeatedly returns to the place in the subway where she enountered a handsome stranger, hoping to run into him again.  Meanwhile, the firm tries to deal with a very demanding client, who has a checklist of the traits her perfect match must have.','2007-03-01 18:46:31'),(71930,71929,2,'After Denise is invited to Greg\'s birthday party for their second date, she gets confused about what kind of signals Greg is sending her, particularly when he keeps disappearing throughout the evening. Meanwhile, Viviana\'s matchmaking skills are put to the test when Clea asks her to take on the task of finding a date for a lesbian client.','2007-03-01 18:46:38'),(71948,71947,2,'Francine has to find a match for a middle-aged accountant, who turns out to have an ulterior motive. Meanwhile, Denise pretends to be an animal lover after meeting a handsome veterinarian.','2007-03-01 18:46:48'),(71965,71964,2,'Cleo\'s former priest, who has now left the ministry to search for his soulmate, asks her out on a date.  Meanwhile, Denise and Barry try to find a match for an ex-convict.','2007-03-01 18:46:55'),(71983,71982,2,'A client walks in whom Clea ended an affair with a couple of months after her divorce, and the gang tries to help her overcome a perceived lack of spontaneity.  Meanwhile, Denise and Barry try to help a client who is curiously reluctant to go on a second date with a woman he liked.','2007-03-01 18:47:01'),(72000,71999,2,'Denise is visited by a formerly-overweight college friend who has achieved a dramatic weight loss and a new attitude toward life.  Meanwhile, Cleo is annoyed that David wants to take their developing relationship more slowly, particularly after she discovers he has a gorgeous roommate.','2007-03-01 18:47:08'),(72020,72019,2,'Learning that her new boyfriend David is super competitive, Clea tries to find some activity where she can beat him.  Meanwhile, Denise and Barry try to help a man who likes a token clerk at the subway station but who finds her unapproachable because she is sealed behind bulletproof glass.','2007-03-01 18:47:15'),(72038,72037,2,'A former client needs help to propose to the woman he met through the firm.  Meanwhile, Denise is persuaded to join Clea for the Thanksgiving holiday, but then Clea doesn\'t want to let her go.','2007-03-01 18:47:22'),(72057,72056,2,'Just when she\'s decided that the only way to get her green card is to accept a marriage proposal from young Charlie, Viviana is shocked when a former flame arrives in town to rekindle their relationship.  Meanwhile, Francine and Barry have to find dates for three geeks.','2007-03-01 18:47:34'),(72080,72079,2,'A surprise visit by Francine\'s overbearing mother causes her to reveal her friendship with the biological father who abandoned them years earlier.  Meanwhile, Barry and Denise try to help a 12-year-old boy win over his first crush.','2007-03-01 18:47:42'),(72098,72097,2,'The gang discovers that Barry was once in the military when his former sergeant shows up, looking to recruit Barry for a new and different mission.  Meanwhile, Denise\'s quest to find the man whose phone number she lost on a subway platform takes a strange new turn.','2007-03-01 18:47:52'),(72117,72116,2,'The staff bring all their dateless clients together for a Valentine\'s Day party, which they\'ve nicknamed \"The Losers\' Ball.\" Meanwhile, Clea feels like she\'s getting mixed signals from David, who has left her alone on Valentine\'s Day, and figures it\'s time to try dating someone else.','2007-03-01 18:48:03'),(72135,72134,2,'Major Curtis returns to the agency, this time to find a match for his daughter, unaware that she is already dating an older man.  Meanwhile, Clea doesn\'t know whether to tell David that she\'s dating another guy.','2007-03-01 18:50:57'),(72155,72154,2,'After seeing her new boyfriend Mike\'s apartment for the first time, Denise tries to avoid the classic mistake of trying to change him -- so she gets Francine to do it.  Meanwhile, Clea and Viviana enlist Barry to show a new client who constantly cracks annoying jokes the error of her ways.','2007-03-01 18:51:10'),(72173,72172,2,'Trying to find a match for an agoraphobic who hasn\'t left his apartment in seven years, the gang finds a woman who is accepting of his disorder, only to discover that he has been lying all along.  Meanwhile, Barry decides to break up with his girlfriend.','2007-03-01 18:51:19'),(72182,72181,2,'Confused about her relationship with David, Clea seeks advice from Viviana\'s psychic and Denise\'s therapist. Meanwhile, Francine is disconcerted when her first date with an attractive man reveals that anything sad makes him cry.','2007-03-01 18:51:26'),(72189,72188,2,'Barry and Viviana try to find a match for a fireman who constantly feels a need to be a hero, and soon loses interest in a woman if she doesn\'t need rescuing.  Meanwhile, Francine starts to feel that Denise\'s boyfriend Mike is ruining their friendship.','2007-03-01 18:51:32'),(72196,72195,2,'Viviana must pass a course to extend her student visa allowing her to say in the U.S and Denise offers to tutor her. Meanwhile, Barry wins an entry in a poker tournament in Atlantic City and enlists Clea\'s support.','2007-03-01 18:51:38'),(72203,72202,2,'With his poker tournament winnings, Barry announces he will help one of his co-workers fulfill their dream and they each present their cases to him. Meanwhile, Clea teaches a clueless female client how to flirt.','2007-03-01 18:51:45'),(72210,72209,2,'When Mike asks Denise to move in with him, things get complicated when she runs into an old friend. Meanwhile, the Love, Inc. staff tries to help a man who is in love with his female friend.','2007-03-01 18:51:52'),(72219,72218,2,'In the premiere episode Stripperella must face-off against her first threat, Dr. Cesarean, a plastic surgeon who\'s injecting beautiful models with deadly implants that make them gain weight and become obese.','2007-03-01 19:00:16'),(72253,72252,2,'After discovering the villain responsible for turning several supermodels hideously fat, Stripperella learns that one of them has been \"booby-trapped\" with a bomb disguised as a breast implant.','2007-03-01 19:00:25'),(72262,72261,2,'Stripperella goes up against that low-rate villain, Cheapo, a criminal who\'s idea of a prime robbery would be knocking over a 99 Cents Store.','2007-03-01 19:00:34'),(72283,72282,2,'Stripperella discovers the truth behind the success of Pushy Galore\'s home shopping networks, which is that Pushy\'s products have been made out of human flesh.','2007-03-01 19:00:41'),(72305,72304,2,'Klinko, a copy store master, uses his copy machines to brain wash customers into criminals and carry out his multiple dirty deeds.','2007-03-01 19:00:49'),(72317,72316,2,'We\'re introduced to the evil Queen Clitoris who, from her hidden island hide-out, is preparing to launch a rampage against men.','2007-03-01 19:00:58'),(72335,72334,2,'After being the bridesmaid and never the bride too many times (226) Molly Lumpkin goes on a citywide rampage kidnapping the grooms from weddings.  Her plan is to choose one to marry and kill the rest with a laser engagement ring.  Stripperella must stage a fake wedding and risk her very own \"Mr. Right.\"','2007-03-01 19:01:06'),(72354,72353,2,'Small fry wants to shrink everything down so he can be big and tall.  Stripperella runs to ruin his plans but she gets shrunk.  The Chief talks to Stripperella and convinces her that being small doesn\'t matter.  So Stripperella goes and wins. Meanwhile Cat, fellow stripper, learns about Erotica\'s secret double life. The problem is, she keeps getting hit in the head and forgetting it...then learning it again...then geting clocked in the head again and forgetting it...then remembering...then forgetting....you get the idea.','2007-03-01 19:01:13'),(72370,72369,2,'Someone is Kidnapping all the smart kids at high school and it\'s up to Stripperella (disguised as student \"Kathy Teria\") to stop who\'s kidnapping them.','2007-03-01 19:01:20'),(72381,72380,2,'Erotica is up for the Stripper of the Year Award in fabulous Las Vegas, but Stripperella has to stop a pair of robbing masked evil magicians. Can Erotica get the award? Will Stripperella foil the crooks in time? And will Kevin ever get his money back?','2007-03-01 19:01:27'),(72391,72390,2,'Cheapo\'s back and ready to steal several bars of copper valued of at least $16, with the help of Erotica going under the alias Robin Stuff. Meanwhile, Kevin gets into trouble over a misunderstanding in a casino and lands in jail and wins a Hawaiin vacation.','2007-03-01 19:01:34'),(72404,72403,2,'Queen Clitoris comes again, and this time she wants Stripperella dead! So Clitoris hatches a fiendish plot and lures Stripperella into her lair on a secluded island. Can Stripperella get off... The island in time to save her own life?','2007-03-01 19:01:41'),(72412,72411,2,'An asthmatic motorist runs off the road to avoid hitting an animal and slams into a tree.  He is bitten by the animal -- a glowing werebeaver -- and he turns into a giant glowing werebeaver that runs amok chewing through anything made of wood and terrorizing the population.  Stripperella must put a stop this rampaging werebeaver.','2007-03-01 19:01:47'),(72425,72424,2,'Lily Manning, separated from her husband, and Rick Sammler, divorced for 3 years, meet by chance when her daughter, Grace, injures her ankle in a soccer game. Rick and Lily meet at their children\'s school and feel an immediate attraction. They date, but family problems interfere: Rick\'s son Eli is having trouble academically, and Lily\'s daughter Grace feels unpopular and unattractive. Rick and Lily are embarrassed when her children catch them entwined on the couch.','2007-03-01 19:19:45'),(72479,72478,2,'Rick is embarresed when he runs into an ex-girlfirend while on a date with Lily. The couple considers taking their relationship to the next level, and they spend their first night in bed reminiscing.','2007-03-01 19:19:52'),(72503,72502,2,'Rick and Lily\'s families gather at the school carnival. Lily and Karen, who don\'t know of each other at this point, are paired to work together in a booth there. \n','2007-03-01 19:20:01'),(72531,72530,2,'After meeting Rick, Judy expresses to Lily her misgivings about Lily\'s blossoming relationship with him. \n','2007-03-01 19:20:07'),(72557,72556,2,'Rick introduces Lily to his kids under awkward circumstances. Jesse gets her first period. Jake tries to reconcile with Lily, but she resists.','2007-03-01 19:20:12'),(72584,72583,2,'Lily faces the reality of being on her own and Judy begins to pull away from her Lily. This happens after Rick offers to remodel the bookstore and Judy feels like the \"odd man out\" because Lily and Rick\'s relationship, she feels, leaves her little time to spend with Lily. \n','2007-03-01 19:20:18'),(72615,72614,2,'Being divorced means Karen and Rick must both go to Eli\'s weekend basketball tournament, creating some awkward moments for them. \n','2007-03-01 19:20:29'),(72641,72640,2,'Lily and Rick deal with the ghosts of their failed marriages. Rick\'s becoming consumed with a project at work triggers Lily\'s memories of Jake doing the same thing in their marriage, causing its downfall. Meanwhile, Eli\'s frustration with his schoolwork reaches new depths. \n','2007-03-01 19:20:35'),(72670,72669,2,'While Lily is at a convention, Judy allows Grace (and Rick and Karen allow Eli), to go to a party that ends up with bad consequences. \n','2007-03-01 19:20:58'),(72704,72703,2,'Lily\'s father decides to invite Jake to Thanksgiving at Lily\'s house against her wishes. Her father has difficulty in deciding whose side of the divorce to support. \n','2007-03-01 19:21:05'),(72729,72728,2,'Jake gets into trouble with his business. A small fire at Lily\'s house causes a lot of worry. Karen struggles with Eli\'s moving into the basement. \n','2007-03-01 19:21:13'),(72754,72753,2,'Lily tells Jake she wants a divorce, and tells Rick about her one-night stand with Jake. Rick can\'t forgive her, putting their future in jeopardy. \n','2007-03-01 19:21:20'),(72778,72777,2,'Jake and Lily begin mediating their divorce, and the future of the house hangs in the balance. Meanwhile, Rick struggles with a demanding client, complicating his partnership with David. At Jennifer\'s insistence, Grace fills in as an English tutor for Eli, and the two discuss Lily and Rick\'s recent breakup. Rick arrives at a decision regarding his future with Lily.','2007-03-01 19:21:28'),(72805,72804,2,'Eli feels tempted to cheat on Jennifer. Karen feels attracted to a younger co-worker. \n','2007-03-01 19:21:36'),(72839,72838,2,'Rick and Lily begin to mend their relationship. Judy meets a man who might fulfill her dreams. \n','2007-03-01 19:21:49'),(72869,72868,2,'Lily hires a divorce attorney. The last straw is after Jake reneges on his promise not to max out their credit card. She finds this out after it\'s rejected at a store. Grace meets a boy who seems to think like her. \n','2007-03-01 19:21:58'),(72898,72897,2,'Lily and her family cope with a life-altering accident. \n','2007-03-01 19:22:05'),(72930,72929,2,'Aaron proves to be a source of comfort and renewal for the Manning family; Lily gains ground in the divorce proceedings. \n','2007-03-01 19:22:13'),(72968,72967,2,'Karen pushes herself far beyond her comfort zone when her involvement with Leo becomes more serious. Eli plays his parents against each other in order to get into a bar to see his friends\' band play. He gets in trouble when he sees his mother, and she sees him, there. Rick finds out that Karen said no and Eli didn\'t tell him that, getting Eli in trouble with Rick as well. \n','2007-03-01 19:22:22'),(73006,73005,2,'Lily\'s new job helps her put her priorities in order. While talking to Grace, Tiffany lets it slip that her relationship with Jake started BEFORE Lily and Jake split up, possibly altering her relationship with her father forever. \n','2007-03-01 19:22:32'),(73032,73031,2,'When Judy\'s continuing affair with Sam is discovered, she takes steps to prevent any more pain from entering her life. Lily realizes just how much she\'s taken Rick for granted when he\'s sick in the hospital. Grace continues to have difficulty with accepting her father\'s past infidelity. \n','2007-03-01 19:22:41'),(73054,73053,2,'Lily says that the kids in the two families should meet. So they schedule a night for that. Zoe is concerned about the environment. Grace again has conflicting feelings about Eli. Jennifer reveals to Grace that Cassidy is cheating on Eli. Grace is hesitant about telling Eli this information. Two of Cassidy\'s friends, Rachel and Lisa, warn Grace not to tell Eli what\'s going on (or else!). Naomi starts a book group and invites Karen, instead of Lily to be in the group because she feels that she and Lily have been drifting apart. Miles lets it be known to Rick that he doesn\'t want David involved on his project. Work pressures threaten to unravel Lily\'s plans for the meeting and they leave Rick on edge. Judy and Karen have a heart-to-heart in the bookstore about their two families. Eli finds out for himself that Cassidy\'s been cheating on him. Pressure from Miles forces Rick to cancel the dinner. A passage from the book the group is reading makes everything clear to Lily and Rick and Karen. The episode ends with the two families standing in Lily\'s doorway across from each other ... \n','2007-03-01 19:22:48'),(73102,73101,2,'Judy turns the bookstore into a \"book club for singles.\" This attracts an interesting clientele, including Jake (who\'s tiring of his girlfriend Tiffany) and Lily\'s boss Christie. Judy isn\'t sure of her attraction to the handyman who\'s fixing up the store. \n','2007-03-01 19:23:04'),(73136,73135,2,'Parental pressure bears down on Eli to get his act together for college. However, Eli wants to form a music group. \n','2007-03-01 19:23:09'),(73166,73165,2,'It\'s Thanksgiving and that means both the Sammler\'s and Manning\'s get together for dinner, whether they want to be there or not. It turns out that the two mothers get along quite well. It\'s Rick and his mom that have issues. She questions whether Rick knows that his children aren\'t doing as well as he would like to think. Barbara sees her son Aaron for the first time since Phil\'s funeral. \n','2007-03-01 19:23:15'),(73185,73184,2,'Changes in the design of Miles\' building that Rick\'s firm are designing means a dinner meeting for Rick - and a reluctant Lily -- with Miles and important clients. When Lily puts her two cents worth in at the dinner, it makes for an awkward evening for Rick. \n','2007-03-01 19:23:21'),(73222,73221,2,'Jesse is taken to a psychiatrist to find out why she isn\'t eating. Karen\'s firm is hired to oppose the building of Miles\' building -- the one Rick is designing. \n','2007-03-01 19:23:27'),(73244,73243,2,'Grace gets her learner\'s permit. She has a crush on Pace, a boy from her driver\'s education class, who seems oblivious to her feelings. So she goes out with Paces\' annoying friend, Spencer, in an attempt to maybe make Pace jealous enough and have him ask her out. The date is a disaster. Tiffany breaks up with Jake when it becomes clear to her that their relationship wasn\'t going to go beyond the physical attraction.','2007-03-01 19:23:32'),(73275,73274,2,'Lily thinks she might be pregnant, and the reaction she gets from Rick wasn\'t what she was hoping for. She begins to think that he\'s not who she thought he was. Grace has an accident in Rick\'s vehicle after being distracted spotting Carla and Eli together. So Grace starts to rethink her opinion of Carla. The episode ends with Rick and Lily making up, and Eli and Carla in the back seat of a car...','2007-03-01 19:23:41'),(73296,73295,2,'Layoffs at her workplace make Lily even uneasier there. But the new management consultant reverses those firings, putting Christie on edge and making Lily look foolish for speaking up at a staff meeting. Christie fires Lily for meeting with Graham behind her back. Judy accuses Lily of taking her BookLovers idea and using it for the magazine at work. Zoe feels abandoned because Grace doesn\'t want to baby-sit and stay home all of the time. In the end, the investors liked Graham\'s presentation, and Grace and Zoe (and Lily and Judy) make peace with each other.','2007-03-01 19:23:49'),(73329,73328,2,'Judy finds herself drawn between two men: the intellectually stimulating Paul, and the physically stimulating Will. Eli grows tired of Carla always wanting to get into trouble. \n','2007-03-01 19:23:55'),(73350,73349,2,'Jessie\'s glitter is missing, and Grace and Carla are the prime suspects. Rick discovers some unsettling news about both sides of his project with Miles. Evidence is discovered concerning Jessie\'s progress in therapy. \n','2007-03-01 19:24:01'),(73371,73370,2,'Jesse doesn\'t want to go to a dance by herself, which frustrates Karen because they bought a dress for it. Christie and Graham continue to clash at work. Karen\'s worried that her relationship with Leo isn\'t building towards something. Lily is uncomfortable with Graham\'s flirting and when she goes to establish that their relationship is purely a working one, he confesses his feelings for her. Rick interrupts him before anything else can happen. When she tells Christie, Christie basically tells her it\'s no big deal. Later, Graham kisses Lily unexpectedly. When Leo shows up late for a museum trip with Jesse, Karen is really upset with Leo because she knows that Leo means a lot to Jesse. She finally decides to break up with him. Lily angrily confronts Graham about it, with Christie present. \n','2007-03-01 19:24:08'),(73389,73388,2,'Rick and David are served with a notice to get an injunction to stop the Atlantor project - and the hearing is on Valentine\'s Day. Grace is troubled by the fact that a building that is helping those who need help is being torn down to build Miles\' (and therefore Rick\'s) project. David is frustrated that no one but him thinks that they have a serious problem with the project and the injunction to stop its construction. Rick sees Grace protesting and they have an argument. David quits the firm because of his opposition to the project. The court\'s decision makes no one happy, with the possible exception on Miles. Rick proposes to Lily, but she feels it\'s not the right time. \n','2007-03-01 19:24:15'),(73419,73418,2,'Tensions between Benny (a busboy) and Giancarlo (the chef) at Jake\'s restaurant boil over. Jake separates the two and tells Benny to go home. He returns with a gun to confront Giancarlo. But he isn\'t there and can\'t be reached, so Benny holds everybody hostage. Over the course of the night, Tiffany hands Jake some surprising news, Grace and Spencer (who\'s there for his grandma\'s 75th birthday) become closer, and Lily realizes her feelings for Rick and accepts his proposal. At the restaurant, at the end of the night, Benny lets everyone go... and then puts the gun to his head... \n','2007-03-01 19:24:20'),(73458,73457,2,'Rick and Lily celebrate their engagement. Tiffany reveals to Grace that she\'s pregnant, but Grace pretty much had that figured out when she heard Tiffany throwing up in the bathroom. Lily and Rick tell their kids about the engagement, and Rick and his kids moving into Lily\'s house. Lily finds out Tiffany is pregnant. When Rick tells Karen about his engagement and move, she seems less than thrilled. When the rooming arrangements are discussed, not everyone is happy with the decisions. Disagreements about where to put things come up also. Rick and Jake put a hole in the wall for a possible bay window, Lily gets upset at Rick for \"making all of the decisions,\" assuming she\'ll just go along with them. A family meeting at the end of the episode resolves a few issues. \n','2007-03-01 19:24:27'),(73482,73481,2,'Aaron returns for an extended stay and impresses everyone with his improvement. Grace and Spencer go back to the restaurant to write about their experience there, but Spencer gets nervous (because he was scared then) and goes home. The voices that have haunted Aaron for so long return at dinner and he freaks out. Shelley returns and says that despite the dinner outburst, he is getting better. \n','2007-03-01 19:24:33'),(73504,73503,2,'Will returns to repair ice damage to Lily\'s house, making for awkward moments for Judy. Judy runs into Paul (the guy who went off on her when she broke it off with him), creating more awkwardness for Judy. Lily grows agitated with Graham\'s constant flirting with the office women. Judy tells Karen that she thinks that Paul is the one calling her late at night. When Jake finds out that part of the repair might include a workspace for Rick in the attic, he says that he won\'t pay for the repairs. Judy hears noises outside her store and calls Jake. Jake confronts Paul and tells him to stay away from Judy and assaults him in the restaurant\'s kitchen. Lily angrily tells Graham that he has a real problem when dealing with women. Lily was going to give Tiffany Grace and Zoe\'s old baby clothes, but decides to save them for Judy\'s (future?) kids. Will reveals to Judy that it was he who was doing the calling and the noises. He angrily tells her she was wrong to dump him, among other things, which totally humiliates Judy into apologizing for her behavior towards him. \n','2007-03-01 19:24:40'),(73531,73530,2,'Lily and Rick begin their wedding plans and want Judy to help, but Judy seems hesitant. Jesse faints and falls in the girls\' locker room. Grace learns of it and voices her concern to Judy. Judy tells Karen, who tells Jesse, and argument ensues. Dr. Rosenfeld tells Rick and Karen to put restrictions on Jesse\'s activities until she eats what Rick and Karen ask her to. Jesse, of course, doesn\'t like this either. Judy reveals to Jesse that she was bulimic when she was younger. Judy finally blurts out that she doesn\'t trust Rick enough to watch Lily get married to him. Karen makes the decision not to let Jesse go on the ski trip with her classmates. This makes Jesse even more upset. Judy and Rick settle, somewhat, their differences. Dr. Rosenfeld makes Karen realize that she can\'t control every possible aspect of her and Jesse\'s life. Lily and Judy make up, and Karen lets go enough to allow Jesse to go on the ski trip. \n','2007-03-01 19:24:46'),(73554,73553,2,'Karen finds out that a grand jury is being impaneled to investigate the Atlantor project. The District Attorney wants Karen to help them, but she is reluctant. She acts nervously around Rick and refuses to discuss the investigation with him. Rick is subpoenaed to appear before the grand jury investigation of Atlantor. Allegations of bribery and arrests are floated about. Lily forces Christie not to print an unsubstantiated story concerning the grand jury. Rick fills his kids in on the situation. He finally talks to Miles, but Miles doesn\'t give him any assurances or definite answers. However, he does reveal that he has cancer, and it\'s advancing throughout his body rapidly, so he might not be around if the case goes to trial. Rick undergoes five hours of questioning by the grand jury. The episode ends with the Cook County sheriff arriving with a search warrant to search Rick\'s apartment... \n','2007-03-01 19:24:55'),(73590,73589,2,'Miles gets indicted and work on the Atlantor project is indefinitely suspended. Rick is invited to appear on a local talk show to tell his side of the story. But instead, he gets ambushed by the host on the air and leaves in the middle of the interview. The DA working on the case does everything but say that he is interested in Karen. They steal a \"moment\" at an awards dinner they both attended. After drinking a lot a a bar with co-workers, Rick comes home and get into an argument with Lily. Rick goes to Miles\' suite and angrily confronts an obviously dying Miles. Rick rambles on to Lily about why she shouldn\'t marry him, but Lily tells him that she does want to marry him - faults and all. \n','2007-03-01 19:25:05'),(73635,73634,2,'Rick and his kids start to move their stuff to Lily\'s and Lily gets a call to sign the divorce papers. Carla tells Eli that she\'s not going back home because she\'s convinced that her parents hate her. So Eli asks Grace to ask Lily about staying at Lily\'s house. Eli gets his reply from the University of Illinois about admittance, and it\'s not good. Lily\'s hesitant about Carla staying with them. Eil tells his dad about the letter, at the dinner table, and neither one of them is happy now. Carla is worried that her plans to travel in Europe in the summer might not happen. Lily discovers medicine missing from her cabinet. Suspecting Carla, she goes to Carla\'s bag and finds them. Carla confesses to Rick about the pills. Lily goes to visit with Carla\'s stepmother and finds out some reasons for her problems. Carla tells Eli, in the middle of school, that she is leaving town immediately for Portland, Oregon. Eli says he wants to go with her. They plan to meet at the bus station that night. Rick finds out about the plan. He finds Eli at the bus station, still waiting for Carla. They get into a heated argument. Eli finds out that Carla left without him. To Rick\'s relief, Lily signs the divorce papers. \n','2007-03-01 19:25:13'),(73656,73655,2,'As the wedding approaches, hardly anything is finalized. Lily\'s father appears to her in her dreams. He asks her to ask Jake \"what\'s been lost\". Grace gets a letter from Carla, who\'s living with her brother, saying that she misses Grace, but not Eli. Grace lies to Eli and says Carla does miss him. Rick finds out that he\'s really low on cash and his accountant asks about scaling back the wedding plans. \"What\'s been lost\" is Jake\'s restaurant. He tells Lily this when she goes to pick up the cocktail napkins. Judy finds out details about Will\'s past through Tiffany, like that he has a daughter he gave up for adoption. Disagreements about who\'s staying where and who\'s paying for what prompt Lily and Rick to call off the wedding. Eli finds Carla\'s letter. Jesse calls Karen to tell her that the wedding is back on, and Karen sheds a tear. Jesse knew that her mother was secretly hoping that Rick wouldn\'t go through with the wedding. Lily\'s mother surprises everyone by showing up. Lily sees her at the ceremony and is overjoyed. Will, it turns out is an ordained minister, so he performs the ceremony. Rick says his vows in Hebrew. Everything goes off without a hitch as Phil looks on...','2007-03-01 19:25:24'),(73680,73679,2,'As the two families merge into one house, disagreements over Jesse and Zoe\'s room decorations dominate the breakfast discussion.  Lily\'s employer, Pages Alive, shuts down, so she\'s out of a job.  Eli\'s busted for marijuana possession following a car accident.  The officer finds Coop\'s marijuana in the car.  This renews Karen\'s demands that Eli get a job and give up music.  Lily, however, has a different opinion.  Karen also talks with Rick about Eli living with her for a while. Predictably, Rick gets caught in the middle.  Rick finally stands up to Karen and says that Eli will be okay.  In the end, Eli ignores his mother\'s wishes and gets a job in a recording studio and continues to live with Rick and Lily.','2007-03-01 19:25:38'),(73710,73709,2,'Grace doesn\'t know what to make of her new teacher.   Judy asks Lily to work at her planned bookstore/cafe.   Lily also interviews at a radio station.  Karen brings up the idea of hiring Jake to work on the bookstore/cafe.   Lily isn\'t sure about that idea or where she wants to work.   She gets hired at the radio station, so she has a decision to make.  Jessie becomes increasingly annoyed by Grace and Eli\'s behavior when they\'re around each other.   Judy and Lily argue about working together.   Judy and Jake resolve the dispute they had the day before and Jake agrees to work on the bookstore/cafe.   Will tells Judy that he found his daughter in Florida and that he\'s moving there to get to know her again.   Eli becomes the subject of Grace\'s journal entries.   Judy finally realizes that she has to do the bookstore/cafe without Lily.','2007-03-01 19:25:47'),(73735,73734,2,'Sam returns to town, further complicating the lives of Judy, Lily, and Rick.  Sam wants to hire Rick to be the architect for a project he has.  Judy, however, wants to hire Rick to redo her bookstore.  Colin is agitated over Sam\'s inability to produce any sketches.  Jake grows increasingly worried with the impending arrival of his and Tiffany\'s baby.  Fearing he\'s having an anxiety attack, Judy tells him to go see her doctor.  Colin gives Rick an ultimatum:  Sam better produce some sketches, or else Rick and Sam will be fired.  So Rick lets Sam know how serious the situation is.  Jake\'s test results are clean and Sam comes through.  Sam and Judy agree that now isn\'t the right time for them to be together.','2007-03-01 19:25:53'),(73757,73756,2,'Jessie and Grace both audition for the same role in a school production of \"As You Like It.\" Mr. Dimitri throws them a curve when he announces that he is planning a musical version of the play. Judy and Sam Blue spend the night together and Lily suspects there is something going on. Judy would like a real commitment from Sam, but he\'s not quite ready yet. Grace tells Mr. Dimitri that Jessie can\'t handle the stress of the play because of her eating disorder and eventually lands the lead role.','2007-03-01 19:26:03'),(73785,73784,2,'A boy in the play school play asks Jesse out. Grace is less than happy with the news, because she thought that the boy was flirting with her during rehearsal.  Karen is upset that Rick didn\'t left her out of the loop on this.  Les takes over a talk show after the host leaves following an argument between the two.  He asks for Lily\'s opinion on a call (while on the air), which leads to her taking over the show that night, and a once-a-week gig after that. Rick and Lily argue about her discussing Jesse\'s \"date\" when it hasn\'t been decided if he\'ll let her go.  Grace thinks about quitting the play (over her sorta-feelings for Tad and the whole Tad-Jesse thing), but that\'s not what she tells Mr. Dmitri.  He convinces her to stay.  Grace is irate that Lily offered to loan Jesse Lily\'s pearl necklace when she wouldn\'t let Grace borrow it earlier.  Grace is starting to think that Lily likes her stepdaughter Jesse more than her.  Karen accuses Lily of using Jesse\'s personal life for radio \"material.\"  Karen goes to see her lawyer about Lily\'s involvement and her being kept out of the loop by Rick.  In the end Lily manages to give what ends up being an apology for the way she\'s acted in the last week to Rick, Karen, and Grace at the same time.','2007-03-01 19:26:11'),(73815,73814,2,'The women (and Grace and Zoe) want to hold a baby shower for Tiffany.  This doesn\'t excite Jake.  He doesn\'t want Grace - and especially Zoe - to have expectations about him and Tiffany.  So Jake discourages the idea of having Zoe at the shower.  So she calls Lily to cancel the shower, which upsets Zoe.  Jake tells Tiffany that she shouldn\'t go home to have the baby just because of him and Zoe.  Lily convinces Tiffany to have the baby in Chicago and to have the shower also.  Jake wants Lily to butt out of \"his business\", but because the kids are involved, he relents.  Judy goes to her doctor to see how many \"baby years\" she has left.  She even tells Lily that she\'s considering in-vitro fertilization.  Zoe is upset over Jake\'s seeming indifference about his upcoming baby.  Jake goes ballistic in front of all the women and kids when he and Zoe get home and the ladies discover that he didn\'t get a gift.  Lily reassures Jake that he is still a good father despite his outburst.  Jake does go to the shower with one of the gifts that Zoe wanted.  Jake explains his situation with Tiffany to Zoe, who seems to be okay with it.','2007-03-01 19:26:19'),(73850,73849,2,'Lily and Karen both have unrealistic expectations for Thanksgiving celebrations. So naturally, nothing goes as planned.  The lighting board at the theater goes out, so rehearsal is postponed.  Lily does all the cooking herself after the kids are all busy.  The pipes underneath the sink rust out, so that messes things up further.  Judy doesn\'t want to be at dinner if Sam is coming (via Rick\'s invitation).  Disagreement over building plans leads to Rick and Sam working on Thanksgiving, which upsets Lily even more.  Karen is depressed about not having anyone to celebrate Thanksgiving with.  She cancels her dinner plans with friends and stays at home in her nightgown all day.  In a moment of reflection, she wonders if she\'s ever been happy, or just making sure everyone else is happy.  The theater janitor kicks them out, so the play rehearsal is moved to Lily\'s house.  She even fills in for one of the students.  Jesse ends up walking home from the theater. Not realizing his mom was still home, Eli brings the band to rehearse at Lily\'s garage.  The kids bicker at the table, so Lily erupts and scolds everyone for NOT helping out with the dinner preparations.  Lily asks Raoul to stay for dinner.  A fire breaks out in the kitchen after Tiffany leaves an oven glove on a shelf above a lit candle.  Rick arrives home as the firemen are wrapping things up.  Everyone (Sam, Judy, & aoul included) have leftovers for Thanksgiving dinner.  All is well in the Sammler household.','2007-03-01 19:26:33'),(73881,73880,2,'Grace finds an \"adult magazine\" in their home recycling bin.  This leads to a whole \"will you talk to Eli about this?\" talk coming from Lily to Rick.  Rick is amazed at Sam\'s continued inability to be with only one woman at a time.  Judy and Sam have yet another awkward conversation, this time at a newsstand.  Judy later confesses to Sam while having lunch that she can\'t kiss him because she wouldn\'t stop once she started.  Lily worries that Rick isn\'t as interested in her now that they\'re married.  Rick confides to Sam that he thinks the same thing about Lily.  Karen and Judy go out to a bar/club.  Karen isn\'t sure she wants to be there in the first place.  She meets a man there, and feels guilty when she ends up spending the night at his place.  Tad makes Jesse uncomfortable at his party.  Lily tells Rick that she doesn\'t necessarily WANT sex, but rather just to BE with him and not have his mind a million miles away.  Judy and Sam have their usual \"we can\'t be together but we have to be\" talk.  Jesse tells Karen about the incident at the party.  Karen says that she doesn\'t have to do anything she doesn\'t want to.  Lily and Rick have a nice heart-to-heart talk to end the episode.','2007-03-01 19:26:43'),(73902,73901,2,'When Eli loses his job and Grace\'s teacher questions her acting, they both learn the hard way that real self-confidence can be one of life\'s toughest accomplishments. Both learn that tough love can be a powerful motivator.','2007-03-01 19:26:50'),(73935,73934,2,'Amid complete chaos, a surprise Christmas Eve delivery of Tiffany and Jake\'s baby unites the Manning and Sammler families like never before. Meanwhile, Judy\'s first encounter with Sam\'s eleven-year-old son doesn\'t go very smoothly.','2007-03-01 19:26:55'),(73959,73958,2,'Flashbacks in the series\' interview style recall a telling incident in the lives of Rick, Karen, Sam Blue\'s estranged wife Jeannine, and Sam himself, who rues another dalliance. Also, when Sam and Judy\'s relationship becomes the talk of the whole family, Sam finally realizes he wants Judy to be more than just a friend. Meanwhile Karen\'s loneliness and discomfort is compounded when Jessie cancels plans with her mom to stay at Lily\'s house.','2007-03-01 19:27:02'),(73982,73981,2,'A tragic accident shakes Karen from her deep depression and sets her up for the toughest battle of her life. This makes Eli and Jessie learn the hard way that their parents are more fragile than they\'d thought.','2007-03-01 19:27:08'),(74015,74014,2,'Jessie\'s anxiety and guilt about her mom\'s slow recovery causes tension with every member of the family, especially Lily. Meanwhile, Eli is in denial about the seriousness of his mother\'s condition.','2007-03-01 19:27:15'),(74042,74041,2,'Grace pursues her teacher and Jessie develops an attraction for her friend Katie.','2007-03-01 19:27:22'),(74068,74067,2,'Sam places his dream of committing to Judy and having a family squarely on the shoulders of his ten-year-old son. Meanwhile, Jake finally realizes his feelings for Tiffany and his new baby daughter.','2007-03-01 19:27:31'),(74093,74092,2,'When Lily\'s brother Aaron expresses a desire to move out on his own with a young woman who is also mentally disabled, she finds it emotionally impossible to let him go.','2007-03-01 19:27:39'),(74121,74120,2,'The prospect that Grace may be romantically involved with her creative-writing teacher troubles Lily, infuriates Jake, and imperils the career of the instructor.','2007-03-01 19:27:47'),(74146,74145,2,'Just when Lily thinks life can\'t get any more complicated, her mother begins to show early signs of Alzheimer\'s disease.','2007-03-01 19:27:53'),(74167,74166,2,'Rick and Lily face more life-altering decisions when he is offered a major architectural position in Australia and she is offered a chance to take her Chicago-based radio show into national syndication. The episode concludes with this show\'s traditionaly black and white breaking of the fourth wall but this time, its the actors and not the characters as they speak about the realtionships formed amid the cast and what the show has meant to them.','2007-03-01 19:28:07'),(74196,3278,2,'When Jennifer and Jack Malloy\'s marriage comes to a halt, Jennie\'s left with the house and the kids and Jack\'s left out in the cold---with a talking toy bunny.','2007-03-01 21:58:17'),(74236,3280,2,'When Jennie invites her soon-to-be-ex over for an anniversary dinner, Jack is convinced that she\'s trying to cook up a reconciliation.','2007-03-01 21:58:26'),(74250,3282,2,'Jennie decides it\'s time to teach Jack a lesson when he asks Ryan\'s teacher out on a date.','2007-03-01 21:58:31'),(74263,3284,2,'Jennie\'s plan to sell her engagement ring to finance breast-enlargement surgery turns out to be a bust when she discovers that her precious diamond is a fake.','2007-03-01 21:58:37'),(74278,3286,2,'Jack has a run-in with Maureen after he takes a reckless ride on his moped.','2007-03-01 21:58:42'),(74290,3288,2,'Jack decides he must make a run for the border after his flu-ridden family runs him all over town to attend to their needs','2007-03-01 21:58:47'),(74304,3290,2,'Ryan and Ross move in with Dad after he urges them to boycott \"women\'s work\" at home.','2007-03-01 21:58:52'),(74317,3292,2,'A family feud ensues after Ross decides to cut off Mr. Floppy\'s foot for luck.','2007-03-01 21:58:57'),(74332,3294,2,'When a handsome house painter doesn\'t put any moves on Jennie, she worries that she\'s no longer attractive and looks to Jack for reassurance.','2007-03-01 21:59:03'),(74343,3296,2,'Jennie asks Jack for help in getting out of the affair she\'s been having with a married man.','2007-03-01 21:59:09'),(74360,3298,2,'Jennie and Jack regret the decision of letting Tiffany spend the night with her friends, one of whom happens to be male.','2007-03-01 21:59:14'),(74374,3300,2,'Tiffany decides to turn to Mom and Dad for help after she lose her school\'s dance fund in a bad investment scheme.','2007-03-01 21:59:21'),(74389,3302,2,'Jennie ends up embarrassing the entire family when she is asked to give a speech at Ryan and Tiffany\'s school.','2007-03-01 21:59:25'),(74405,3304,2,'Jack moves back in to the house for the sake of the kids, but must live in the basement until he can win Jennie back.','2007-03-01 21:59:37'),(74416,3306,2,'When Tiffany gets a zit and Ryan sets the scale to ten pounds more than normal, Tiffany tries to develop a personality and Jennie starts jogging.  Jennie becomes Vicky Vixen on the Internet, and Ryan finds that Vicki Vixen has the hots for him.','2007-03-01 21:59:43'),(74440,3308,2,'Jack leaves Jennie\'s room for the basement because she won\'t let him have his ways, but he finds a giant rat in the basement and makes the kids get rid of it.','2007-03-01 21:59:50'),(74451,3312,2,'When Jennie gets a date with Ray Paul Jones, her teen crush, she gives Jack the right to fantasize about a celebrity.  Jack picks Cindy Crawford and gets arrested for stalking her.','2007-03-01 22:02:26'),(74519,3314,2,'Disasters occur when Jack teaches Ryan and Tiffany how to drive.','2007-03-02 08:34:19'),(74530,3316,2,'Jennie gets a glass table on Ross\'s ninth birthday and throws everyone out of the house for getting the table dirty.','2007-03-02 08:34:23'),(74542,3318,2,'When the family earns 40,000 frequent flyer miles, Jack wants to go to Las Vegas and Jennie wants to go to Hawaii.  Meanwhile, Tiffany gets in a fight with Patty, a cheap girl who Ryan is in love with.','2007-03-02 08:34:26'),(74565,3320,2,'When Ryan gets all D\'s and F\'s on his report card, Jennie says he can\'t have the car keys until he gets a B, so he makes a deal with Miss Taylor, his Civics teacher.  Meanwhile, Jack tries to figure out why Ryan is so dumba nd Tiffany begins to suspect that the mailman is her father.','2007-03-02 08:34:30'),(74586,3322,2,'Tiffany thinks Jack doesn\'t trust her when he doesn\'t let Tiffany go in her room with Mike, her boyfriend.','2007-03-02 08:34:34'),(74601,3324,2,'When Ryan starts taking urine tests for football players, he gets a lettered jersey and the respect of a football player.  Meanwhile, no one notices Tiffany, because of Ryan being on the football team, when she gets the highest SAT scores in the school and becomes a national merrit scholar.','2007-03-02 08:34:38'),(74622,3326,2,'After Tiffany and Ryan take Jack\'s car to a party without his permission, Jack and Jennie pretend the car is stolen, until it actually is.','2007-03-02 08:34:43'),(74639,3328,2,'After seeing a movie, Jennie takes the family to a picnic to bond.  But the picnic trip is soon ruined by gophers, poison ivy, and pesticide.','2007-03-02 08:34:46'),(74654,3330,2,'Jack is thrown in jail when Jennie punches a meter maid.  Jennie won\'t bail Jack out and things are terrible around the house without him.','2007-03-02 08:34:50'),(74675,3332,2,'When the family becomes obsessed with horoscopes, Ryan looks for a girl and Jennie tries to be nice.','2007-03-02 08:34:53'),(74694,3334,2,'Tiffany is disturbed when Danny, a boy, doesn\'t want to go to the Valentine\'s Dance with her.  Ryan plans on taking Ms. O\'Hara, his chemistry teacher, but she blows herself up.  Mr. Floppy sends obscene mail to Pamela Anderson.','2007-03-02 08:34:57'),(74712,3336,2,'Jack uses his height to beat Ryan at basketball for the 2001st time.','2007-03-02 08:35:00'),(74724,3338,2,'Jennie relives her high school days when Tiffany is cast as Juliet in Romeo and Juliet.  Jack helps Ryan practice his one line for the play.','2007-03-02 08:35:04'),(74740,3340,2,'Jack starts writing stories that are really Floppy\'s and gets a big break, but later tries doing his own writing.','2007-03-02 08:35:08'),(74756,3342,2,'Tiffany isn\'t the smartest girl in the class anymore when she is put into a smarter class.','2007-03-02 08:35:12'),(74777,3344,2,'It\'s summer break Ryan has just finished his senior year.  After Ryan gets fired from the used car lot, Jack threatens to kick him out of the house if he doesn\'t get a job.  So Ryan goes to Cheeseburger Community College, but finds he must repeat his senior year.  Jack tries to keep the family out of the basement and works the night shift so he doesn\'t have to deal with the kids.','2007-03-02 08:35:16'),(74791,3346,2,'After taking Jack\'s advice, Ryan becomes engaged to Crystal, a thirty year old woman with two kids.','2007-03-02 08:35:21'),(74811,74810,2,'Even though Susan leaves her fiancé, Kip, at the altar, her ties to his family aren\'t severed---her boss is Kip\'s brother.','2007-03-02 11:51:28'),(74863,74862,2,'To cover a story, Susan spends time with an assertiveness-training guru---who sends her chutzpah level soaring off the charts.','2007-03-02 12:03:16'),(74888,74887,2,'When Susan\'s dull love life becomes the topic of discussion at <i>The Gate</i>, she sets out to explore her options---including office romance.','2007-03-02 12:03:43'),(74910,74909,2,'When her utilities are cut off, Susan jumps through hoops to get them restored. But trouble ensues when she writes an exposé on the incident.','2007-03-02 12:03:58'),(74939,74938,2,'Vicki begs Susan to sub for a pneumonia-stricken player when her basketball team makes the playoffs---not realizing Susan might steal the show.','2007-03-02 12:04:09'),(74966,74965,2,'To get out of dinner with her parents, Susan tells her mom a little white lie---and gets caught in it.','2007-03-02 12:04:48'),(74989,74988,2,'At Susan\'s prodding, Jack hires a sweet senior citizen---who proceeds to wreak havoc around the office.','2007-03-02 12:04:59'),(75016,75015,2,'Susan falls for a nihilistic rocker, and the attraction is mutual - despite a severe conflict of lifestyles and values. \n','2007-03-02 12:05:09'),(75035,75034,2,'Susan tries to put together a traditional Thanksgiving dinner for her co-workers, but everything goes wrong, culminating in an oven that\'s colder than the frozen turkey. Her luck seems to change when she locates a repairman willing to work on Thanksgiving - but then he drops dead while still inside the oven. \n','2007-03-02 12:05:26'),(75054,75053,2,'Susan reluctantly does a favor for Jack by attending a charity function with Jack, his wife Margo, and her incredibly obnoxious brother. When Susan finally tells the creep off, Margo and her brother storm out, leaving Susan alone to deal with an inebriated Jack, who winds up spending the night on her sofa. But the next day Margo is not quite willing to believe that\'s all that happened. \n','2007-03-02 12:05:36'),(75071,75070,2,'When Jack\'s too strapped to award Christmas bonuses, the staff (led by Susan) goes on strike.','2007-03-02 12:05:45'),(75091,75090,2,'To prove that personality is more important than good looks, Susan is fitted with a large fake nose. But complications arise with the arrival of a hunky accountant.','2007-03-02 12:05:55'),(75118,75117,2,'Susan and Vicki appear on <i>The Rosie O\'Donnell Show</i> after writing a parody of self-help dating books.','2007-03-02 12:06:11'),(75150,75149,2,'Susan accompanies Jack to his grandfather\'s funeral, hoping her tacky sympathy card to the family will go unnoticed.','2007-03-02 12:06:19'),(75183,75182,2,'Susan gets involved in a new romance with a guy who has two kids---one of whom takes an immediate dislike to her. Meanwhile, Jack takes a stand with Margo.','2007-03-02 12:06:28'),(75202,75201,2,'While filling in as baby sitter for Adam\'s kids, Susan unexpectedly meets his ex. Meanwhile, Jack sets up his bachelor pad.','2007-03-02 12:43:50'),(75228,75227,2,'Susan makes a decision about moving in with Adam; Jack rebounds into a new relationship; Todd receives threats after writing a scathing review of Menudo.','2007-03-02 12:43:54'),(75248,75247,2,'Susan tries to shake a leechy acquaintance, whose divorce was inspired by Susan\'s wedding-day breakup with Kip. Meanwhile, Todd grows apart from his pal Jerry.','2007-03-02 12:43:58'),(75270,75269,2,'Jack takes the gang on a weekend retreat at his cabin---and all of them wind up having interesting encounters in the wilderness.','2007-03-02 12:44:01'),(75288,75287,2,'Luis is reunited with his younger brother, who arrives from Cuba all grown up---and with news of his lifestyle that troubles Luis. Meanwhile, Susan learns of Kip\'s engagement.','2007-03-02 12:44:04'),(75313,75312,2,'Susan\'s plans for a picture-perfect anniversary party for her parents come screeching to a halt when she spies her dad having lunch with another woman, and kissing her in an extremely friendly fashion. Trying to duck her mother\'s questions about her father\'s unusual behavior, Susan is horrified when Liz inadvertently reveals that she is having an affair. Meanwhile, Jack\'s intimidating German squeeze, Kate, wants to hang out with Vicki - much to Vicki\'s dismay, since she\'s convinced Kate\'s appetite for danger will ultimately kill Jack, and perhaps some innocent bystanders as well. \n','2007-03-02 12:44:07'),(75331,75330,2,'A poker game turns into a high-stakes bottlecap-tossing competition, and Jack\'s old roommate, Cooper; hits the jackpot at Jack\'s expense: Jack loses the magazine to him. And that\'s not all - he may lose Susan to the new boss as well. \n','2007-03-02 12:44:11'),(75352,75351,2,'While Susan prepares to fly to Venice with Cooper, Jack tries to find the courage to utter three, make that five, little words about his feelings for her. He fails -- but Susan, having figured it out, has a miserable time with Cooper in Europe. After rejecting Cooper\'s extremely premature marriage proposal and returning home, she confronts Jack, accusing him of using her to compete with Cooper. Jack finally convinces her that his feelings are genuine -- but Susan tells him that she doesn\'t love him. \n','2007-03-02 12:45:15'),(75374,75373,2,'Deciding to go after the new investigative reporter position Jack has created, Susan reluctantly seeks professional advice from her old high school rival Maddy Piper, now an established and aggressive journalist - who quickly infiltrates Susan\'s professional and personal lives by double-crossing her, getting the story and the job, and displaying considerable interest in Jack. Meanwhile, Vicky is being driven crazy by the fact that the bagel delivery guy shows no sign of remembering the night they spent together; and Todd is disturbed by the fact that his web-surfing inevitably lands him in lesbian chat rooms. \n','2007-03-02 12:45:19'),(75399,75398,2,'Margo\'s drunk with power during her divorce proceedings with Jack, thanks to Susan\'s inadvertent slip about Jack\'s intoxicating past: she interprets the fact that Jack fell asleep on Susan\'s couch as evidence that he had an affair with her, thus violating their pre-nuptial agreement. Now Susan must testify in court about her true feelings for Jack. Meanwhile, Vicky becomes obsessed with the idea that someone is tampering with her lunch; and Todd begs Luis to teach him how to dance. \n','2007-03-02 12:45:22'),(75417,75416,2,'Family conflict rises to the top of the agenda at the funeral of Susan\'s grandfather, since Liz wants a traditional funeral while Nana wants a party to celebrate her spouse\'s wonderful life, and Susan is too busy organizing a tribute to her grandfather to deal with her own grief. Meanwhile Vicky, Todd and Luis go to the wrong funeral home and find themselves comforting the wrong widow; and Jack becomes the reluctant owner of a very, very ugly dog. \n','2007-03-02 12:45:27'),(75441,75440,2,'A background check is in order when Susan agrees to meet a gentleman who sent her a rare book as a token of his readership appreciation - and who turns out to be still in high school. Meanwhile, Jack plays pimp for his ugly pooch; and stress takes its toll on Todd when he is put in charge of the magazine\'s new web site. \n','2007-03-02 12:45:32'),(75467,75466,2,'Susan\'s conflict with Maddy begins to invade her dreams, so she turns to a therapy group for help; Pete\'s partner thinks Pete and Jack are an item.','2007-03-02 12:45:37'),(75488,75487,2,'Vicki goes to dinner with Nana---and they become fast friends; Todd\'s hippie parents show up with some unexpected news.','2007-03-02 12:45:41'),(75505,75504,2,'Susan\'s attraction to a hunky actor gets a bit complicated after she sees him bomb onstage; Todd struggles with claustrophobia.','2007-03-02 12:45:45'),(75523,75522,2,'Susan, overcome with that Thanksgiving spirit, decides to spend time with an elderly resident of a nearby retirement home.','2007-03-02 12:45:49'),(75543,75542,2,'Susan is appalled when she misses a deadline but discovers that Nana covered for her by submitting an article in her stead - which Jack and her fans think is the best thing she\'s ever written. Desperate to find an idea for an even better column, Susan ultimately does the obvious: writes a confession about the previous column. Meanwhile, there\'s a big change in Vicky\'s life when she finds a wallet and falls for its handsome owner, only to discover that he\'s a rabbi. \n','2007-03-02 12:45:53'),(75563,75562,2,'Susan twists Jack\'s arm to participate in the holiday choir she\'s organizing---then she has her regrets, in more ways than one.','2007-03-02 12:45:57'),(75584,75583,2,'Shaken from witnessing Jack and Maddy\'s kiss, Susan shares her disappointment with Vicki---who shares it with the whole office. Meanwhile, Vicki tries to get closer to Ben.','2007-03-02 12:46:01'),(75599,75598,2,'Vicki\'s torn about Ben\'s unusual proposal; the guys head to Reno to capitalize on Luis\' streak of good luck; Susan consults a spiritual healer.','2007-03-02 12:46:04'),(75623,75622,2,'Susan fixes Nana up with a charming businessman---who\'s not exactly how he appears; Vicki arrives in Israel and tries to adapt to life on a kibbutz.','2007-03-02 12:46:08'),(75640,75639,2,'Believing Luis was discriminated against at a car-rental agency, Susan launches an undercover investigation. Meanwhile, Vicki gets hung up in customs while returning from Israel.','2007-03-02 12:46:13'),(75656,75655,2,'Todd and the gang attend a Shawn Colvin performance, but the singer recalls Todd from his scathing review a year earlier. Meanwhile, Susan\'s apartment gets robbed, so she decides to get a gun.','2007-03-02 12:46:17'),(75679,75678,2,'Hospitalized, Jack puts Susan in charge of the magazine---much to the chagrin of Maddy, whose father, an esteemed journalist, is visiting.','2007-03-02 12:46:21'),(75702,75701,2,'A stranger claims to have known Susan in a past life, so she undergoes hypnosis; Luis and Todd lose Jack\'s dog while using the pooch as a prop for meeting women.','2007-03-02 12:46:24'),(75723,75722,2,'On her birthday, Susan expects a surprise party---but the gang seems to have forgotten; Todd accidentally downloads a computer virus that wipes out <i>The Gate</i>\'s files.','2007-03-02 12:46:28'),(75745,75744,2,'Todd joins Susan at a poetry class to meet women---but his verses end up being better than hers; Vicki\'s new apartment may be haunted by a womanizing ghost.','2007-03-02 12:46:32'),(75766,75765,2,'Vicki looks for love at a hockey game, but it\'s Susan who attracts the attention of one of the athletes; Todd and Luis vie for the attentions of a new water-delivery \"man.\"','2007-03-02 12:46:36'),(75793,75792,2,'Kenny flies in for a visit---and proceeds to smother Susan with attention; the gang plots to surprise Luis with a visit from his mom, all the way from Cuba.','2007-03-02 12:46:40'),(75819,75818,2,'Susan\'s sent to interview a congressman---who makes a pass at her; Vicki plans a glitzy wedding; the guys hope to cash in by selling yellow bell-bottoms.','2007-03-02 12:46:44'),(75839,75838,2,'When the congressman turns the tables on Susan, she finds herself in the middle of a scandal, searching for a way to clear her name.','2007-03-02 12:46:48'),(75862,75861,2,'Vicki\'s folks arrive for her wedding---a double ceremony shared with gay couple Pete and Hank; Todd\'s parents ready for the birth of twins.','2007-03-02 12:46:52'),(75884,75883,2,'Edie may not make it to Vicki\'s wedding ceremony.','2007-03-02 12:46:56'),(75903,75902,2,'Following on from the second-season cliffhanger, Jack and Susan head from the wedding reception to Susan\'s place with love on their minds forgetting that Susan is letting Todd stay at her place while his parents are in town. Next day Jack sends Todd out of town on an assignment and takes Susan to dinner, but she reacts badly to his eagerness to finish the meal and walks out. Fortunately, wise Nana gives her a stern talking-to, which leads to a reconciliation. Meanwhile, newlyweds Vicki and Ben also have trouble consummating their honeymoon in Hawaii, finally ignoring a hurricane evacuation order for more important business; Luis and Maddy engage in a game of cat and mouse focusing on flirtation and rejection, with Maddy wearing provocative outfits to tempt Luis but continually refusing him. \n','2007-03-02 12:47:03'),(75930,75929,2,'When Jack and Susan finally get the chance to consummate their new romance, it\'s not the earthshaking experience they were expecting. Finally they agree to relax their unrealistic expectations and immediately have great sex in Jack\'s office. Meanwhile, Luis accidentally thwarts Todd\'s attempts to fulfill his lifelong dream of catching a foul ball at a Major League game when Luis knocks the ball into the hands of an obnoxious 10-year-old. Luis tries to apologize by taking Todd to another game, at which the ball bounces off Todd\'s head into the hands of you guessed it. Meanwhile, Vicki returns from her honeymoon furious that Maddy never gave her a wedding present, and for revenge makes off with the expensive vase from Maddy\'s desk. Is this appropriate behavior for a rabbi\'s wife? Ben thinks not. \n','2007-03-02 12:47:08'),(75949,75948,2,'In a desperate attempt to keep her romance with Jack a secret from the office grapevine, Susan tells bloodhound Vicki that she\'s dating her dentist, Mort Gerken -- only to have Vicki decide that Mort is cheating on Susan. Meanwhile, Todd challenges Maddy to an IQ test, staking his prime-parking place in the office garage on the outcome; and Luis celebrates his fifth anniversary at <i>The Gate</i>. \n','2007-03-02 12:47:12'),(75973,75972,2,'Susan\'s relationship with the boss begins to take its toll on her friendships at work, and the tension boils over when the gang attends Career Day at Susan\'s old school and she is humiliated by her old teacher, Mr. Vance, who fills the others in on how Susan\'s figure used to be filled out. Meanwhile, after Todd tries in vain to coach Luis at darts for a bar competition, they discover that Pete is a whiz at the game not realizing that he folds under pressure. Vicki develops an odd romantic problem: she\'s become a \"man magnet\" since her marriage to Ben. \n','2007-03-02 12:47:16'),(75993,75992,2,'Jack misses Susan\'s Halloween party and then won\'t explain his whereabouts to protect Maddy, who called him from jail when she was arrested for drunk driving, leaving Susan furious until a reluctant Maddy confesses part of the truth. At Susan\'s party her landlady Mrs. Fong wears a remarkably convincing Dr. Joyce Brothers costume (who guest stars as herself); no one can figure out what Susan\'s costume is supposed to be; superstitious Luis is upset when he learns Todd is dating a real witch; and Nana encourages Pete\'s partner Hank to strike a new attitude which Pete does not appreciate. \n','2007-03-02 12:47:20'),(76017,76016,2,'Susan and Jack worry that they\'re incompatible when they, as a couple, fail miserably at games, and Susan finally throws out Vicki and Ben after a particularly humiliating fiasco at charades. When they decide to consult a therapist, he opines that they are again trying to measure their relationship against an impossible ideal, rather than having fun together in the moment. When they leave they discover the next patient is Todd, troubled by recurring erotic dreams about Jack which the doctor explains as projections of Todd\'s resentment at being \"screwed over\" by Jack\'s promises of a raise which never materializes. Meanwhile, Luis and Nana are mugged in an alley by a costumed clown who demands Nana\'s wedding ring, whereupon she beats him to a pulp and he barely escapes with his life and Luis\' expensive camera equipment. \n','2007-03-02 12:47:24'),(76034,76033,2,'After a tremor shakes things up at <i>The Gate</i>, the staff rescue from the stalled elevator a shaken Lily, a nonagenarian survivor of the 1906 earthquake who shares her off-the-wall story (told via flashbacks featuring the cast) about Lily\'s mother, an aspiring singer (Susan); a lovesick busboy (Jack); a fortuneteller (Nana); two cough-drop moguls (Todd and Luis); and Enrico Caruso.','2007-03-02 12:47:28'),(76049,76048,2,'When Jack and Susan head off on their first weekend together, they\'re sidetracked by a visit to Jack\'s lowlife cousin Wallace and bamboozled into baby-sitting his kids, who are a handful. Meanwhile, Luis (and everybody else) hangs out at Susan\'s place, awaiting delivery of her new mattress. \n','2007-03-02 12:47:31'),(76072,76071,2,'When Grandmother Richmond invites Jack and Susan to her mansion for Thanksgiving, Jack initially refuses. He hasn\'t been friendly with his parents since he started dating Susan, whom they hate for abandoning her former fiancé, Jack\'s brother, on her wedding day. Jack and Susan agree to attend only after learning that the parents will not be there. However, Grandmother Richmond tricked Jack -- his parents do come -- in order to force the family to reconcile. As Jack and his parents\' bickering escalate, Susan tries vainly to make peace. Jack finally defiantly blurts out that he plans to move in with Susan. At first, Susan is angry with Jack for announcing something that they have hardly discussed. But later, she agrees that it\'s a good idea. Meanwhile, Todd and Luis persuade Grandmother Richmond to let them come to the mansion as well--but they end up playing a perilous game with the family\'s crazy, gun-toting Uncle Bert. Also, Vicki reluctantly helps Ben and a volunteer staff to serve Thanksgiving dinner to the homeless. She is elated, however, when she finds out that she will supervise Maddy, who is doing community service as a penalty for driving while drunk. A huge food fight ensues between the two women. \n','2007-03-02 12:47:34'),(76090,76089,2,'As Susan and Jack search for an apartment together, Susan wonders if Jack is really interested in living with her. His blood pressure rises whenever the subject is discussed, and he finds something to dislike in 22 consecutive places that Susan loves. Finally, when Susan makes an appointment with a handsome real-estate agent to look at the most fabulous apartment of all, Jack does not come at all. To her surprise and embarrassment, an upset Susan finds herself kissing the agent. Later, when Susan confronts Jack about his attitude and confesses what she did, Jack becomes furious. Meanwhile, Todd and Vicki vie for the favor of Mrs. Fong, the landlady of Susan\'s current apartment. Each wanting the choice apartment when Susan moves out, they competitively do errands and pamper Mrs. Fong. Also, Maddy reluctantly asks Luis to take her photograph as a present for her mother, but Luis must make extreme efforts to get Maddy to smile for the camera. \n','2007-03-02 12:47:38'),(76109,76108,2,'Susan is distraught because she kissed the realtor, and asks Luis to help her make things up with Jack. Jack spends the night with another woman, and when Luis arrives, agonizes whether to tell Susan: Luis advises against. Maddy goes to a party in a $3000 dress. Todd dates the female cantor from Ben\'s temple, who expresses herself in such a vocal manner that she loses her voice by the end of the evening, causing Vicki to become distraught, as a TV crew is coming to film the cantor. Meanwhile, Maddy suffers a dramatic allergic reaction to the food at the party that causes her to bloat enormously, and stretch the dress so much she can\'t take it back to the shop as she was planning. Jack eventually decides he has to tell Susan, and she reluctantly decides they should end their relationship. \n','2007-03-02 12:47:41'),(76133,76132,2,'After a brief vacation in Las Vegas, Nevada, Luis astounds everyone by announcing that he married a pretty Honduran woman, Rosie. Meanwhile, Susan is still recovering from recently ending her relationship with Jack. When Susan observes Rosie secretly meeting a man and tells Luis about it, he accuses Susan of being influenced by her own bad luck in love. But Rosie soon admits that the man is her boyfriend and that she only married Luis to gain U.S. citizenship. Susan commiserates with Luis. After Maddy cancels a coveted appointment with an extremely exclusive hairstylist, Lukaro, Vicki tries to convince him to work on her hair instead. Lukaro punishes Vicki for her stubbornness by styling her hair to look exactly like Maddy\'s. Also, Todd enrolls in a program to help fatherless youths. Unfortunately, his protégé is a childish 35-year-old man, Andy. Todd helps Andy mature by introducing him to a real youngster who needs guidance. \n','2007-03-02 12:47:44'),(76154,76153,2,'When Nana almost has a car accident because she can\'t hear an ambulance\'s siren, Susan insists that Nana get a hearing aid. This makes Nana feel old, and she becomes lethargic and uninterested in anything. Meanwhile, free from his responsibility to Susan, Jack overcompensates by indulging in more and more dangerous sports. Susan reinvigorates Nana by convincing her to go skydiving with Jack -- and Jack forces Susan to jump from the airplane as well. Meanwhile, Luis and Vicki become jealous of Maddy\'s super efficient new personal assistant, so they hire one. For the small amount of money Luis and Vicki can pay, they get a moron. However, Todd and Luis gloat when Maddy\'s assistant turns out to be a con artist who robs Maddy\'s apartment, steals her car and empties her bank accounts. Also, Todd makes an ill-advised attempt to establish a career as a mime-imitating passerby. \n','2007-03-02 12:47:47'),(76171,76170,2,'After Maddy is rejected by a television newsmagazine, Susan and the gang find her at a bar, extremely drunk. Since Maddy has been arrested for drunk driving before, Susan worries that Maddy is an alcoholic. She also finds vodka bottles in Maddy\'s office. Susan rallies her workmates, and they confront Maddy to say that they\'re concerned about her alcohol drinking. Maddy gets indignant and leaves, making Susan feel guilty. But later, Maddy secretly attends a meeting of Alcoholics Anonymous. Meanwhile, Todd can\'t wait for his \"date\" at the home of a sexy woman he just met. Unfortunately, he is so excited that he does exactly what the woman wants: he buys a huge amount of Tupperware storage containers from her. Also, Susan needs a new car--and Vicki wants to make sure it meets her own standards so she can borrow it. \n','2007-03-02 12:47:50'),(76185,76184,2,'Jack, Susan, Maddy and Luis attend a journalism conference. Suspicious that Jack wants to renew his romance with her--which she doesn\'t want--Susan is surprised when he reunites with a sexy former girlfriend, Megan Garrity. Susan tries to make Jack jealous by flirting with a bitter, unresponsive columnist but later learns that Jack was only trying to make her jealous. Meanwhile, recovering alcoholic Maddy, who is surrounded by cocktail-drinking conventioneers, cannot drink and is also forbidden from smoking on the premises. After exhausting her obsessive desire for cashews and chewing gum, Maddy releases her tension in the only vice available to her: wild sex with Luis. With Jack gone, Todd plans to use the office for a 1960s-themed party. Unfortunately, Vicki arranges for Ben to host a senior citizens\' bingo game in the office for the same night. The two gatherings clash until bingo player Eddie meets his old friend, \'60s partier Flo. They bring the two groups together with a rendition of the Turtles\' song \"<i>So Happy Together</i>. \n','2007-03-02 12:47:54'),(76206,76205,2,'Luis and Maddy continue their lustful affair at every opportunity. After Todd witnesses the couple having sex in the supply closet, Luis wonders if he is sacrificing his personal life for a meaningless relationship. Maddy doesn\'t pretend that Luis is anything but a replacement for her alcohol addiction, but Luis cannot refuse the great sex either. Meanwhile, Vicki\'s meddlesome mother Edie and long-suffering father Leon visit. Edie constantly complains about not being a grandmother yet. When Ben returns from a trip, Vicki makes passionate love to him--and he dies of a heart attack. Distraught with guilt that she killed her husband, Vicki moves in with her parents to a trashy trailer in Arizona. She seems doomed for a life of bitterness and failure until Susan finds out that Ben had a serious heart condition that he kept secret; he was due to die anyway. After Susan informs Vicki, they return to San Francisco. Ed McMahon guest stars as himself in search of a multi-millionaire sweepstakes winner whom he just can\'t seem to find. \n','2007-03-02 12:47:58'),(76221,76220,2,'Now living alone in the same building as Luis, manipulative Vicki constantly reminds him of how lonely and \"helpless\" she is since her husband died. Luis guiltily does apartment repairs and cleaning for Vicki as well as cooking her meals. However, the chores interfere with his covert sexual relationship with jealous Maddy. Also, a confused Jack misinterprets an overheard conversation and believes that Luis is dating Vicki. After climbing down the apartment fire escape and witnessing Luis having sex with Maddy, Vicki gleefully tells everyone at work. While defending herself, Maddy inadvertently admits that she truly likes Luis, to his pleasure. Meanwhile, upon learning that Susan is dating a record producer, Zach Hayword, Todd forces her to play Zach a recording of Todd\'s singing. Susan doesn\'t want to jeopardize her relationship with Zach by taking advantage of him, but she tries to trick him into listening to the tape. When Susan fails, Todd accuses her of not being a good enough friend but later realizes that he is selfish. Ultimately, Zach dislikes Todd\'s music anyway. \n','2007-03-02 12:48:02'),(76235,76234,2,'Susan doesn\'t recognize her former classmate, Cindy, who renews her friendship with Susan. Cindy recounts how Maddy terrorized both Susan and her in school. She confesses that she was depressed and went to a therapist for years due to one particularly traumatic prank, which she assumes Maddy instigated. To her horror, Susan remembers that she played the prank on Cindy accidentally, intending it for Maddy. Susan never knew how devastating it was on Cindy. Nana tells Susan not to admit her guilt because Susan\'s friendship is the only good thing Cindy has to remember from school. When Cindy arrives at <i>The Gate</i> to retaliate on Maddy, Susan tells Cindy it wasn\'t Maddy\'s fault. However, Susan still helps Cindy extract her revenge on Maddy. Meanwhile, when Vicki blithely gives away her deceased husband\'s clothes and possessions, Luis worries that she is suppressing her sadness. Todd finds that wearing Ben\'s outfit makes him feel spiritual, but Vicki keeps mistaking Todd for Ben. In a disoriented moment, Vicki finally expresses her grief, crying and yelling at Ben for leaving her alone--then she realizes she is in Todd\'s arms. Also, it particularly upsets Jack that Ben was younger than Jack when he died. Jack creates more stress in his life by trying to prove how youthful he is. \n','2007-03-02 12:48:06'),(76250,76249,2,'Hollywood Hulk Hogan is a shoo-in for city supervisor after the sudden death of the incumbent. That is, until Susan weighs the option of squaring off with him. She has already attacked him in <i>The Gate</i>, and when he calls her out, she rises to the challenge and the grudge match is on.','2007-03-02 12:48:10'),(76265,76264,2,'After the disastrous debate with Hollywood Hogan, Susan decides to fight back with a sleazy TV campaign. Meanwhile, Hogan infiltrates Susan\'s camp---by hitting on Vicki.','2007-03-02 12:48:15'),(76279,76278,2,'Luis has his first photography exhibition at an art gallery managed by Susan\'s friend. At the opening party, Susan notices that the buyers are intimidated, so she purchases one of Luis\' paintings to spur business--not realizing that the artwork is much too expensive. Fortunately, a collector later offers her almost twice as much money for the photograph. Feeling guilty but needing the cash, Susan agrees. However, Luis is so proud and grateful that Susan bought his work that she cannot tell him that she sold it. She breaks into his apartment to steal the negative and make a copy so Luis won\'t notice the photograph isn\'t hanging on her wall. After Luis finds out what really happened, he is glad his art is worth so much money, and he convinces Susan to just be honest with him. Meanwhile, Todd is perturbed when Jack dates Todd\'s sexy visiting sister Oxnard. Behaving like an overprotective father, Todd tells Jack not to have sex with Oxnard. However, Todd needn\'t worry--Jack is strangely reminded of Todd when trying to kiss Oxnard and is no longer able to consider sex with her anyway. \n','2007-03-02 12:48:19'),(76299,76298,2,'Susan finally gets her new boyfriend, Zack, to commit some of his busy schedule to her. Feeling sorry for lonely Vicki, Susan invites her to join Zack and her at a club appearance by Zack\'s friend, rock star Warren Zevon. However, Zack obviously has much more in common with Vicki that with Susan, frustrating her. The next night, while Zack and Vicki flirt, Warren attempts to get a date with an unreceptive Susan. When Susan and Vicki argue with each other and confront Zack, he admits that he likes Vicki and Susan equally--and he wants to have sex with both of them at once. Disgusted, Susan and Vicki abandon Zack. Meanwhile, Jack makes an ill-advised bet with rival newspaper editor Sam: the loser in a bowling match between Jack\'s employees and Sam\'s must get a Mohawk haircut. To challenge Sam\'s expert players, Jack recruits Maddy, an excellent bowler, along with mediocre Todd and awful Luis, who can\'t even keep the ball in his own lane. However, Maddy distracts Sam\'s guys with sexy poses, and she uses a strange but effective method to coach Luis into making a crucial spare to win the game for Jack\'s team. Also, Todd is upset when the bowling alley switches his favorite sneakers for a pair of green European clogs when Todd returns his rented bowling shoes. However, once he feels how comfortable the clogs are, he happily keeps them. \n','2007-03-02 12:48:23'),(76322,76321,2,'The season finale is a memorial to former series star David Strickland, who committed suicide in mid-season. After buying a used cellular telephone, Vicki becomes exasperated from receiving frequent calls to its previous owner, a psychic named Charlene--until, by pretending to be Charlene, Vicki manipulates a date with wealthy, lovelorn Eric. Eric unfortunately discovers the ruse when he calls Charlene and hears Vicki\'s telephone ringing. Meanwhile, Luis cannot figure out why Maddy is so irritated at having to take care of him while he suffers from a head cold. Maddy finally admits that she has bad memories of caring for her alcoholic mother. Since Jack gave Todd the day off from work, no one thinks much about Todd until Susan notices that he left her the wrong tickets to a concert that night. Unable to contact Todd at home, Susan goes on a quest to find him and learns details about his personality that she never appreciated before: an elderly woman recounts how Todd buys her health drinks and listens to her; some kids tell Susan that Todd pays for their games at a video arcade; and a barber informs Susan that Todd visits every week to teach him guitar. When Todd fails to arrive at the much-anticipated concert, Susan worries that something is wrong. She gathers the concerned Nana, Jack, Luis, Maddy and Vicki. They learn that, because of an accident, they will never see their friend again. Clips of Todd from the series\' entire run follow. \n','2007-03-02 12:48:29'),(76355,76354,2,'Susan and co-workers Vicki and Luis find their work life disrupted by their new boss, Ian Maxtone-Graham, who buys <i>The Gate</i> and transforms it into an upscale men\'s magazine. He brings with him his fiercely loyal executive assistant, Miranda Charles, and hires star sportswriter Nate Neborsky, who immediately annoys Susan with his belittling attitude. However, she is amply distracted by the arrival of charming and highly prized celebrity photographer Oliver Brown. Ian fawns over Oliver to convince him to work free-lance for the magazine. Investigative reporter Maddy quits after Ian insults her talent, and ends her relationship with Luis because his love has made her complacent. When Ian offers Maddy the job of managing editor--which she later rejects--Susan thinks that quitting is the way to get his respect. To protest being assigned to write a salacious article, she quits. Although Nana enjoys Susan\'s full attention for two weeks, she encourages Susan to find another job rather than waiting for Ian to call. Susan finally confronts Ian after learning that he plans to publish the sex article as if she wrote it. Even Internet sex object Cindy Margolis is offended when she sees an advance copy of the \"Suddenly Susan\" column. Realizing that she doesn\'t put enough of her own personality into her work, Susan offers to provide a strong woman\'s point of view to the magazine, prompting the spiritually minded Oliver to defend Susan and agree to take the all-important cover photograph. Unwilling to antagonize Oliver, Ian rehires Susan. \n','2007-03-02 12:48:37'),(76374,76373,2,'Susan and Nate vie to be the one responsible for helping Luis to overcome his melancholy following Maddy\'s departure.','2007-03-02 12:48:42'),(76389,76388,2,'To impress Ian, Susan claims to speak Russian. However, when he asks her to be an interpreter for a dinner-party guest, she\'s at a loss for words.','2007-03-02 12:48:46'),(76406,76405,2,'When Oliver suggests taking pictures of the staff to put in their columns, Susan objects because she never looks good in photographs. But Oliver puts Susan at ease and gets a beautiful portrait of her. Ian likes it so much that he makes a huge billboard out of it. Susan is initially mortified, but she soon enjoys the adulation. However, Vicki rejects Susan\'s new self-centered attitude. While trying to force Vicki to look at the billboard, Susan crashes her car, causing Vicki to need bandages on her face. Meanwhile, Nate tries to secure an interview with baseball great Reggie Jackson. After seeing Susan on the billboard, Reggie demands a date with her in return for the interview. Nate tricks Susan into meeting him and Reggie for dinner. Susan learns the truth and is outraged. When Vicki interrupts the meal, she and Susan bicker so much that Nate does not get any good quotes from Reggie for the magazine article. Later, Susan writes a column about how men cannot view women as both sexy and talented. She also reconciles with Vicki, who goes on a date with Reggie. \n','2007-03-02 12:48:49'),(76423,76422,2,'Susan isn\'t sure if she should put out a welcome mat when Vicki wants to move into the newly renovated apartment upstairs.','2007-03-02 12:48:53'),(76440,76439,2,'At Halloween time, rumors abound when Oliver invites Susan to pick pumpkins with him up the coast. Susan is excited about the romantic outing, but she soon becomes uncomfortable with the realization that Oliver has had dozens of short-term lovers all over the world. Susan resolves to thwart any relationship that might develop with Oliver. After he suggests that they carve pumpkins together at Susan\'s apartment, Susan invites Vicki to make the evening less like a date. But Susan cannot resist Oliver\'s sex appeal. She sends him away--and he stays all night with Vicki. Susan is furious until she learns that he only slept on Vicki\'s couch after becoming drunk. Later, Susan admits to Oliver that, despite her attraction to him, she does not want to be another of his flings. \n','2007-03-02 12:48:58'),(76458,76457,2,'An assignment to do an article on a cheerleaders\' competition doesn\'t make Susan jump for joy, but her attitude changes when she\'s asked to audition.','2007-03-02 12:49:03'),(76476,76475,2,'After realizing that she\'s not achieved any of the goals that she set in the sixth grade, Susan tries to fulfill one: to kiss former teen idol Leif Garrett.','2007-03-02 12:49:08'),(76497,76496,2,'Oliver freaks out when Susan calls him her \"boyfriend\"; Ian thwarts Vicki\'s plot to party on company time.','2007-03-02 12:49:12'),(76511,76510,2,'When Ian rejects Susan\'s column the night before the magazine is to be printed, Susan is unable to think of another topic. To help inspire herself, she writes a long parody of Nate\'s negative attitude towards gay people and circulates it among the office staff. Unfortunately, Ian gets a copy of the offensive article and, bored by the mundane replacement that Susan stayed up all night to write, prints the parody as Susan\'s opinion. Soon, gay people picket the magazine\'s offices, and powerful gay-owned businesses refuse to advertise in <i>The Gate</i>. Susan is vilified. When a gay activist smashes a pie in Susan\'s face, she develops an allergic rash and must withdraw from a trip with Oliver, who plans to travel to a Caribbean island to photograph models. Since Susan also cancelled a date with Oliver due to the article deadline, he thinks that she is jittery about her relationship with him. Angry, he takes Luis with him instead. Later, Ian orders Susan to reconcile with the gay community before the magazine is ruined by the bad publicity. Along with Vicki and Miranda, Susan builds a float for the gay pride parade, but only a cross-dressing Ian joins her in riding it. When Oliver returns and sees Susan participating in the parade, he briefly assumes she is gay, and then realizes that he is wrong. \n','2007-03-02 12:49:17'),(76534,76533,2,'A frumpy coworker guilt trips Susan into attending her birthday party---on the night Susan has romantic plans with Oliver.','2007-03-02 12:49:21'),(76555,76554,2,'Susan\'s ex thwarts her plan to join the \"mile high club\" with Oliver; Vicki cons the gang into painting her apartment.','2007-03-02 12:49:25'),(76573,76572,2,'Inspired by her romantic bliss with Oliver, Susan hosts a dinner party to play matchmaker for her single co-workers.','2007-03-02 12:49:29'),(76594,76593,2,'Susan is depressed because Oliver always pays for their dates, and she is in debt. When she offers to take him on a ski vacation that she cannot really afford, she desperately tries Internet stock trading, hoping to earn money quickly. After overhearing Ian talking about a supposedly promising stock, she buys some shares that soon gain value, prompting her to buy more. Unfortunately, the stock then plummets in value, and Ian informs Susan that he was talking to his insane cousin whom he doesn\'t take seriously. Susan loses a lot of money. Now desperate, she takes a second job as a dance partner for lonely, middle-aged men. When Ian finds out, he feels guilty. He sneaks into the dance studio and secretly bribes men to give Susan big tips. Susan is grateful, but she rebuffs the gesture. Finally, Oliver arrives and dances with her. She admits that she doesn\'t want to be dependent on him and that she cannot pay for the Tahoe trip. Oliver is happy--he confesses that he can\'t ski anyway; he just agreed to go to make Susan happy. The lovers vow to be honest with each other and live thriftily. \n','2007-03-02 12:49:32'),(76609,76608,2,'While Susan believes that she and Oliver love each other, she obsesses over his apparent inability or lack of desire to say the three magic words -- \"I love you\" -- despite his grand attempts to express his feelings in other ways. Elsewhere, Ian is deflated when the first bottles of wine from his vineyard yield nothing more than a thick intoxicating syrup. And no one knows this more than Miranda and Luis, whose unlikely flirtation is further complicated when they sample Ian\'s vintage. \n','2007-03-02 12:49:36'),(76625,76624,2,'Susan worries that she might be pregnant, but her fear eases when boyfriend Oliver suggests that they move in together -- and then unloads a bombshell that has Susan still reeling the day after. At the same time, Ian exults when he learns that his money-grubbing ex-wife plans to re-marry and spare him of his financial commitment. \n','2007-03-02 12:49:41'),(76643,76642,2,'Ian and Nate have romantic designs on Susan, who is suddenly single after dumping Oliver. Meanwhile, Susan and the girls get rowdy at a male strip club. \n','2007-03-02 12:49:45'),(76662,76661,2,'As Susan and Oliver go through withdrawals in the wake of their aborted romance, he offers her a parting gift -- a talking cockatoo -- who soon flies the coop and gets haplessly stuck in <i>The Gate</i>\'s venting system, where he creates a squawking uproar. Meanwhile, a vengeful Vicki and Luis conspire to embarrass Ian at his lavish party by inviting his former British band mates from his 1960s stint as a lead singer of a one hit wonder pop group.','2007-03-02 12:49:49'),(76688,76687,2,'Oliver and Susan are still not dating. After an embarrassing incident at her college alma mater, Susan becomes enamored with her handsome former English professor, Evan, who lovingly critiques her writing. Susan\'s burgeoning relationship with Evan makes Oliver jealous. Although he has his own sexy date, Oliver becomes obsessed with Susan both at work and elsewhere. \n','2007-03-02 12:49:53'),(76709,76708,2,'To sow the seeds of reconciliation with Susan, Oliver has his vasectomy reversed. Meanwhile, Ian seeks Miranda\'s advice about dating black women.','2007-03-02 12:49:57'),(76728,76727,2,'Susan feels torn between Oliver\'s marriage proposal and a glamorous New York job offer.','2007-03-02 12:50:01'),(76748,76747,2,'Susan may leave a man at the altar---again---when Oliver stands in the way of her career.','2007-03-02 12:50:05'),(76782,76781,2,'Ben is annoyed to learn that both Janey and Susan are patients of another dentist...especially since Janey had a crush on this dentist. Nick uses Ben\'s laptop to have an \'email romance\' with Isabelle - a famous model...Who\'s lying to whom...?','2007-03-02 12:55:44'),(76811,76810,2,'When Michael is bullied by Jason Hodder at school, a meeting between his parents and Ben and Susan doesn\'t help at all! Janey tries to persuade Susan to let her get a tattoo, to no avail. Michael later tells Susan that Janey has punched Jason Hodder. Meanwhile, Nick decides to become an internet billionaire!','2007-03-02 12:55:48'),(76826,76825,2,'When Janey is set up on a date with the son of Lord Whitten, she is over the moon because <i>\"he\'s absolutely gorgeous\"</i>. Ben returns home to find that Nick has become an artist (!) and Susan has booked him tickets to the opera to see <i>Don Giovanni</i>. After listening to a tape of the opera, Ben doesn\'t want to go. When Janey tells Ben and Susan that young Whitten tried to assault her, Ben gets revenge by being less than compassionate when Lord Whitten\'s son needs dental work the next day...is he making a mistake?','2007-03-02 12:55:51'),(76843,76842,2,'For Susan\'s 40th birthday, Ben...or rather Janey...decides that he and Susan should go away for the weekend. They decide to go to a bed and breakfast they went to 20 years ago. There, they encounter a rather rampant old couple who...put nicely...like to occasionally swap partners. Meanwhile, Michael charges Janey £10 an hour to let her leave him home alone, after Nick passes off his responsibility to her.','2007-03-02 12:55:55'),(76867,76866,2,'When Susan worries about the rising crime rate, she insists that the family get a new alarm system - much to Ben\'s annoyance. Despite what Mitch, the salesman, says, Ben decides to opt for the cheapest system on offer... which has alarming concequences. Meanwhile, Nick decides to become a stripper while Brigitte insists on moving the furniture in Ben\'s surgery around.','2007-03-02 12:55:58'),(76889,76888,2,'Ben insults Mrs Dudley, yet another of his disgruntled patients, at his surgery and also chats to Father Connolly about death. When he gets home, he has more death to talk about as Nick\'s new girlfriend, Emily, tries to sell him life insurance and Susan tells him that one of her tourists died in Madame Tussauds. Meanwhile. Janey buys a water bra.','2007-03-02 12:56:03'),(76917,76916,2,'While Susan is clearing out everyone\'s old clothes for charity (mainly Ben\'s), Michael worries about what to do on a date... and gets advice from, of all people, Nick. Also, Janey defies Susan and buys new jeans that cost £98 and Brigitte decides to \'align the vibrations of Ben\'s surgery with Mother Nature\'.','2007-03-02 12:56:08'),(76933,76932,2,'When Susan finds Viagra in Nick\'s room, she starts to become over concerned about why he has it. Ben is diagnosed with Hypertension...but not before he admits to taking the Viagra believing it to be the cause. Also, Susan allows her yoga teacher to hold classes in their house. Nick gives Ben mouth to mouth when he thinks he\'s having a heart attack and Brigitte is her usual self at the surgery.','2007-03-02 12:56:11'),(76952,76951,2,'Ben has a new assistant, but doesn\'t like him! Susan suggests that Nick could be his new assistant... which Ben naturally refuses. Susan, to demonstrate she\'s the better parent, offers Nick a job as a tour guide, in which he does well... except for taking the tour group to the pub, getting arrested, and taking them for a guided tour of the house! Meanwhile, Ben discovers that Janey\'s excellent grades are down to the fact that she has several boyfriends... one for each subject.','2007-03-02 12:56:18'),(76974,76973,2,'When Susan tells Ben that she might be pregnant, he\'s not impressed. She suggests he thinks about it. The next day, while listening to Trudy, his new assistant, talk baby talk to her boyfriend on the phone, he upsets a pregnant patient by saying how terrible children and teenagers are. When everyone finds out about Susan\'s secret, she breaks the news that she isn\'t in fact pregnant...much to Ben glee. Susan thinks Ben has had a vasectomy, but has he? Also, Nick delights Ben by telling him he\'s a bad father.','2007-03-02 12:56:22'),(76996,76995,2,'Ben is convinced the French exchange student they\'re housing, Sylvie, is interested in him but who does she really fancy? Michael is horrified when he discovers he\'ll have to sleep in Nick\'s room.','2007-03-02 12:56:26'),(77011,77010,2,'Janey wants to have a party to celebrate getting an A at school, while Ben and Susan make themselves scarce. Barely miles from home they become obsessed about what the kids could get up to in their absence and turn back. They creep in and hide in the bedroom which unfortunately for Ben, has a blocked en-suite toilet. The party continues without incident until the neighbours complain about a man urinating out of a window... who could that be?!','2007-03-02 12:56:31'),(77039,77038,2,'Aunt Margaret has passed away and the family are invited to the funeral. Susan is bed ridden suffering from Flu so it\'s up to Ben and Nick to travel to Leeds to represent the family. Nick tries to make the best of the hotel accommodation and an opportunity to humiliate his father in the process.','2007-03-02 12:56:34'),(77060,77059,2,'Ben gets another assistant who faints at the sight of blood. Janey is getting ready to take her driving test and Ben and his next door neighbour Mr Casey start a \"war\".','2007-03-02 12:56:39'),(77078,77077,2,'Susan decides to redecorate the living room but the project stalls as she has trouble deciding the colour she wants. Janey tests her parents\' liberalism by having Stupid Brian stay in her room while he\'s involved in the redecorating project and Nick teaches himself to tune pianos.','2007-03-02 12:56:42'),(77091,77090,2,'Nick gets an older girlfriend called Amanda who is not only married but old enough to be his mother. Michael gets a new computer and Janey feels left out.','2007-03-02 12:56:47'),(77105,77104,2,'Ben gets a new patient, a Mr Smith who seems to be a mob leader. Ben keeps getting unwanted presents appearing on the doorstep such as tyres, meat and a watch. He has to tell Mr Smith that he doesn\'t want the presents and Mr Smith asks for the watch back. The only problem is, Susan has found the watch and thinks it\'s for her...','2007-03-02 12:56:51'),(77126,77125,2,'Susan sends Janey, in her place, to see her \'dying\' mother. There Janey learns the Harper family secret and a discussion of family history sends Ben searching for less banality in his family tree. Michael stands for office at his school, leading to Ben\'s horrified realization he\'s somehow brought up a Tory.','2007-03-02 12:56:55'),(77150,77149,2,'Susan, eager to please her boss invites him into her home and even lets him sleep in the bed she shares with Ben. Unfortunately for them, he dies which is in itself distressing, but not half as much as trying to decide what to do with the bed he was sleeping in.','2007-03-02 12:57:00'),(77167,77166,2,'Money seems to be on everyone\'s mind. First Nick starts selling his body parts on eBay, then an old schoolmate looks Ben up just to brag on being a millionaire and his perfect wife. Jealous, Ben finally calls him for a stock tip, and invests the college fund, but can he trust his gut to tell him the right time to sell?','2007-03-02 12:57:04'),(77189,77188,2,'Nick\'s decision to become a motorbike stunt driver brings more worry for Susan while Jenny\'s new job isn\'t what she expected it to be. Also, Ben\'s surgery is vandalised by a fired dental-assistant who wants revenge!','2007-03-02 12:57:07'),(77211,77210,2,'Janey\'s off to University...and Ben couldn\'t be happier! - just think what he can do with her room? Although Susan isn\'t so happy to see Janey go, she too has plans for her room. \n\r\nAlso, Nick gets a job in a supermarket and lands the Harper\'s with 100s of tins of tuna, and lands Ben with a criminal record!...','2007-03-02 12:57:14'),(77227,77226,2,'Michael, embarrassed of his parents, fails to hide a letter inviting them to a school charity auction and his parents, on Susan\'s say so, end up going anyway.\n\r\n\n\r\nAt the auction Susan bids for nearly everything and one of the items include a free couple\'s therepy session. Also, Ben despairs when a patient with very bad breath bids for free dental treatment in his surgery.','2007-03-02 12:57:18'),(77245,77244,2,'Susan, still missing Janey, decides that she needs some female company and so invites Abi, the daughter of a hated cousin of Ben\'s, to dinner. \n\r\n\n\r\nAbi turns out to be the most accident-prone, clumsy person you could meet. After a couple of visits to casualty it\'s clear that Ben would rather not ever see her again, not that that is of any consequence to Susan.\n\r\n\n\r\nAlso, Nick decides to become a magician - just where did Ben\'s favourite white jacket and watch go?','2007-03-02 12:57:23'),(77257,77256,2,'Abi has to make a video project about family life and decides to film the Harpers, of course, typical to the Harper family life Abi doesn\'t quite get the cooperation she needs.\n\r\n\n\r\nAlso, Ben and Susan are terrorised by a rat that seems to be immune to any form of pest control.','2007-03-02 12:57:27'),(77268,77267,2,'After Susan becomes paranoid about the tone of a phone call from her daughter she gets Ben to drive her all the way to Manchester to see if she\'s okay.\n\r\n\n\r\nSatisfied Janey is doing more than okay Ben and Susan decide to make the best of their failed rescue attempt and turn it into a chance to re-enact their youth. They book into a local hotel under fake names and pretend to meet each other again as strangers. However, will Susan end up taking too much advantage of the idea and will a mix up with room keys land Ben in a very embarrassing situation?\n\r\n\n\r\nMeanwhile, back at home, Abi\'s having difficulty stopping Michael competing with her new boyfriend. \n','2007-03-02 12:57:32'),(77295,77294,2,'The Harpers experience internal competition regarding a nativity play when both Nick and Susan audition for parts. Who will get a leading part and who will be cast as a shepherd? \n\r\n\n\r\nAlso Ben is suffering from a severe toothache but is reluctant to put his trust in any other dentist.','2007-03-02 12:57:36'),(77320,77319,2,'Michael has got his eye on a girl in his class, but his mother Susan doesn\'t approve of his choice. She is even less pleased when she finds a joint in his super-secret sock drawer.\n\r\n\n\r\nBefore she and Ben confront him with their evidence, they decide to\n\r\ntry a new way of parenting and a more open and peaceful approach to dealing with drugs...','2007-03-02 12:57:39'),(77332,77331,2,'When Susan, much to Janey\'s disgust, plans to visit her daughter in University, Ben plans (and looks forward to) a golfing weekend.\n\r\n\n\r\nInstead the entire family end up at the university and Ben, Susan, Janey and the poor university student in the showers... get more than they bargained for, especially when Nick decides to become a female impersonator who seems to take his act a bit too seriously. \n\r\n\n\r\nAlso, Nick finds out how much pain is involved in waxing his legs and Micheal wants to go on a trip to Greece and won\'t stop at anything to get his parents concent.','2007-03-02 12:57:44'),(77356,77355,2,'When Nick wins an old car in a poker game, he wants to use it for parts but Ben tries his best to restore it to it\'s former glory...sadly with little success. Will he and Susan ever get to Dorset for their anniversary weekend away? Meanwhile, Abi finds Michael in her room and has some fun teasing him.','2007-03-02 12:57:49'),(77366,77365,2,'Ben is annoyed when he discovers that his family have forgotten his birthday, but has slightly more to worry about when Janey arrives with her \'lesbian girlfriend\', Katie! Is Janey really gay or has she got an ulterior motive? Also, Nick\'s new job involves dressing up as a gorilla and Michael seemed a little bit too interested in Katie\'s lifestyle...!','2007-03-02 12:57:53'),(77379,77378,2,'When the children go away for the weekend, Ben and Susan finally have some time to themselves. Unfortunately, it has been so long since that happened that they have absolutely no idea how to spend it','2007-03-02 12:57:57'),(77387,77386,2,'A name from the past comes back to haunt Susan, who is determined to dampen the old flame - but not before Ben gets singed.\n\r\n\n\r\nMeanwhile Nick\'s new taxi business is driving his father mad and Abi is convinced the Harper home is haunted.','2007-03-02 12:58:01'),(77407,77406,2,'Nick decides to get his own flat but, as always for Ben, every silver lining has a cloud.','2007-03-02 12:58:06'),(77429,77428,2,'Janey returns to the Harper household for Christmas, but with some shocking news...she\'s pregnant! Also Nick begins his new Christmas Tree business, except the trees are all for next year - Ben is overjoyed to find his living room full of trees.','2007-03-02 12:58:09'),(77439,77438,2,'Susan is looking forward to the birth of her first grandchild, but not to being a grandmother. Nick wants to move back in. And a new arrival at Ben\'s surgery has quite an impact.','2007-03-02 12:58:14'),(77465,77464,2,'When Roger shows some talent at acting, Susan decides to jump on the bandwagon and takes dancing lessons...and a \'wine tasting\' class! Michael is disappointed when he gets a B in an exam.','2007-03-02 12:58:18'),(77485,77484,2,'Ben has neglected to fix the broken toilet seat and winds up having his mother-in-law under his roof while she recuperates from a nasty fall from the throne.  Nick as usual, finds a way to exploit the situation.','2007-03-02 12:58:22'),(77501,77500,2,'When the local paper announces Ben\'s death, he sees it as an opportunity to avoid doing all the things he doesn\'t want to do.','2007-03-02 12:58:26'),(77517,77516,2,'The Harpers\' marriage is threatened by Susan\'s discovery that the love poem Ben wrote to woo her was not an original.','2007-03-02 12:58:31'),(77537,77536,2,'Janey\'s baby is due, and Susan insists on travelling to Manchester for the birth. The journey throws up several blasts from the past.','2007-03-02 12:58:34'),(77556,77555,2,'Susan witnesses something so shocking, she becomess hystericly blind, she tries to hide it from Ben, but to no avail. Meanwhile, Nick develops a new hobby - wrapping.','2007-03-02 12:58:38'),(77575,77574,2,'Susan decides to enter enthusiastically into the spirit of `trick or treat\' for the neighbourhood children, which Ben tries to ignore until the spirits get to him','2007-03-02 12:58:42'),(77598,77597,2,'Susan decides that Ben should spend more time with Michael in case he turns into another Nick. Janey leaves the grandparents to babysit Kenzo','2007-03-02 12:58:45'),(77610,77609,2,'Ben and Susan have to go back to school for parenting classes as a result of Michael playing truant.','2007-03-02 12:58:49'),(77625,77624,2,'The Harpers get a free holiday to Lanzarote, and even though Ben loses his luggage, he is happy enough to use his brand new digital camera as much as possible.','2007-03-02 12:58:54'),(77651,77650,2,'Abi\'s father asks Ben to be his best man, which turns out to have been a bad move. Ben also asks Nick to host a stag party, which goes awry.','2007-03-02 12:58:57'),(77665,77664,2,'The Harper house is quarantined because Roger is contagious. Nick goes into business with an eighteen-foot python, while Michael gets to grips with a rocket launcher.','2007-03-02 12:59:00'),(77681,77680,2,'A shopping trip to London turns sour when the tube train grinds to a halt. Countdown\'s Richard Whitley guest stars.','2007-03-02 12:59:03'),(77698,77697,2,'Ben and Susan look back at the last few years of family conundrums and troubles after Ben breaks Susan\'s leg.','2007-03-02 12:59:09'),(77731,77730,2,'More problems for Ben as Janey drops out of University and moves back home, Susan lies to the police, Michael\'s is born again and, after dismanteling his car, Abi confuses nature with naturism. But will a few wise words from an off-duty vicar help him to finally see the light?','2007-03-02 12:59:14'),(77753,77752,2,'Ben has taken a dislike to Michael\'s geeky friend Hubert. He\'s therefore relieved when Michael acquires a new, and much cooler, school mate Jack. Michael is soon dressing trendily and hanging out with the cool kids at school.','2007-03-02 12:59:18'),(77765,77764,2,'Ben and Susan decide to help out some friends by flat sitting their brand-new Docklands apartment.','2007-03-02 12:59:22'),(77778,77777,2,'Susan tries to play the role of \'matchmaker\' for Roger while Ben is trying to teach Roger how to \'chat up\' the ladies. Roger then gets a call girl to try and make Abi jealous but it ends up costing him a fortune to keep the \'romance alive\' with her.','2007-03-02 12:59:26'),(77801,77800,2,'Ben becomes jealous of Roger winning a £20 gift voucher on the Times Crossword puzzle and tries to prove to himself that he can do crosswords as quick as Roger but Susan demands Ben\'s full attention and support after she decides to run for the recently open post for Council to try and change to world by ridding it of Dog Poo. Michael meanwhile has got a new pregnant verminous spider - Nicola who has mysteriously disappeared from his bedroom!','2007-03-02 12:59:30'),(77824,77823,2,'The prospect of imminent death often concentrates the mind and the prospect of Ben\'s is no exception. After visiting 4 different websites, Ben is now convinced he has just a year left to live and decides to write his will with the secondary purpose of trying to get his children to love (or just notice) him. Susan meanwhile organises Ben\'s funeral, not helped by Nick taking a job at the undertakers.','2007-03-02 12:59:34'),(77838,77837,2,'Susan feels that she doesn\'t have enough time to do the housework while holding down her job, therefore decides to interview as many cleaners as possible to find the correct one. She then decides on Martha who not only does the cleaning but does the cooking as well and the rest of the family enjoy it. However as a result Susan starts to feel obsolete and tries to get rid of her by sabotaging the house and eating Ben\'s mint chocolate sweet left on his pillow.\n\r\n\n\r\nMeanwhile Michael is trying to get a date with a girl at school who loves football by learning everything about football as possible (much to Ben\'s delight as this is the only subject he knows more than Michael about) and Abi is trying to get a job at a library by learning every single word in the dictionary!','2007-03-02 12:59:38'),(77856,77855,2,'Ben buys Susan the 33 DVD box set of Inspector Morse and then tells her of his rich patient who confessed to killing his wife while he was being sedated.\n\r\n\n\r\nSusan then tries to figure out the mystery behind Mr Addis and his wife. In the meantime, Michael has another new girlfriend and Susan tries to figure out everything about her, but Michael isn\'t too keen on Susan finding out.','2007-03-02 12:59:42'),(77871,77870,2,'Susan is increasingly annoyed at Ben\'s consistent snoring while she is trying to get to sleep and suggests \'alternative\' ways to deal with the ordeal. However it doesn\'t seem to work and leads to a separation of beds.  Both Ben and Susan then have \'perfect\' freedom in their lives because of this, however Abi has seen this before, having witnessed 5 separations involving her dad.  She feels that Ben and Susan are heading for divorce and is convinced she is the cause of all family breakups. \n\r\n\n\r\nMeanwhile, Janey has started her own shopping business from her old room while the boiler at her flat is being fixed and has become an \'assistant shopper\' for both Abi and Michael.','2007-03-02 13:00:56'),(77884,77883,2,'A film crew uses the Harper\'s street to film a new movie which stars many famous British actors, one of whom needs a \'normal classic\' dentist sparking a war between Ben and Roger over their new famous customer. \n\r\n\n\r\nAlso Janey finds a way to manipulate Roger to become his \'date for the night\' just to mingle with the stars and Michael starts a scam to make money out of the film crew by charging them extortionate amounts of money to use the toilet.\n\r\n\n\r\nMeanwhile, Susan\'s tourist firm is being taken over by another company and she gets fired, but can she figure out a way to leave on her own terms?','2007-03-02 13:01:00'),(77897,77896,2,'Susan is bored with her lot and opts to run her life as a single girl again; Janey takes the opportunity to try running the home with a husband who is less than perfect; and Ben just runs away.','2007-03-02 13:01:04'),(77915,77914,2,'Susan attends a neighbour\'s book club; Michael runs a booking agency exclusively for Roger; Ben books a seat on the sofa, but gets a new assistant too close to home.','2007-03-02 13:01:08'),(77933,77932,2,'Ben is scheduled to attend a dental conference, and Susan decides not to join him as she\'s decided to write a novel. Ben, however, needs someone to go with him as he\'s positioned himself to become part of a Harley Street practice, so he settles for Janey. Through various twists, everyone shows up at the hotel with much resulting confusion.','2007-03-02 13:01:13'),(77970,77969,2,'Janey introduces her new fiancé, Ches, to her parents. Ben is less than supportive as, for a start, Ches is actually older than he is. Regardless Ben manages to accept the man his daughter has chosen to marry and desperately avoids the potential to make a fool of himself at the wedding. Susan, pleased she gets to play the role of \'mother of the bride\' ends up making a bigger fool of herself than Ben. In the end however, it\'s Janey who gets the last laugh...\n\nMeanwhile, Michael, who is knee deep in girlfriend problems, is auctioning off his sisters wedding gifts on E-bay and Nick is apparently stuck in the African Jungle and is sending video taped pleas to his parents for money packages to be sent to him.','2007-03-02 13:01:17'),(78006,78005,2,'Fund raising special.','2007-03-02 13:01:21'),(78026,78025,2,'Ben has that same old Christmas feeling of despair as the frustrations of family life, as ever, live up to his worst fears. But this year\'s celebrations look like being even more fearsome as Susan seems set on giving grandson Kenzo a third birthday to remember. Nick sends a Christmas present that could have a lasting effect on the household and Susan\'s mother has found herself a toy boy, whose present – and presence – causes mayhem.','2007-03-02 13:01:24'),(78037,78036,2,'\'Doctor\' Buck, an American author, stays over at the Harpers, which again angers Ben. Elsewhere, Michael spends time with a woman, who is impressed by artefacts he supposedly found in his garden, and Roger is also trying to impress, when he starts talking to Abi in Welsh.','2007-03-02 13:01:29'),(78057,78056,2,'Ben starts a one man anti-cycling campaign that causes chaos in the household. An old acquaintance of Susan, Hilary, visits, boasting about her family, which makes Susan even more determined to fare better at fundraising. Janey meets Hilary\'s son, who no longer looks like a nerd, and starts dating him. And Roger shows off his cooking skills.','2007-03-02 13:01:34'),(78084,78083,2,'Ben is away at a conference, so smooth-talking locum Tony covers. Janey immediately falls under his charm, but her and Susan very shortly discover that he is married. However, despite both of them knowing that Janey must end this relationship, getting rid of Tony isn\'t as easy as they think. Meanwhile, Michael gets involved in another money-making scheme; two parents are trying to get their son into their local school and seek his help in doing so. Things go accordingly to plan, until the school\'s headmistress comes and visits.','2007-03-02 13:01:38'),(78103,78102,2,'After Roger shows off his brand new, expensive watch to Ben, Ben and Susan both get caught up trying to sell \'Pyramus\' products, believing that they will be super rich in doing so, and that they will consequently be able to afford a nice, big boat and pay for Kenzo to go to a private school, amongst other things. And when they see Roger driving in his new Porsche, they go even more crazy about \'Pyramus\', reacting by ordering yet more products--despite Michael\'s warnings.','2007-03-02 13:01:42'),(78130,78129,2,'Ben purchases the house next-door in hope of making quick money by furnishing it and then selling it on. However, he encounters a large problem when squatters take over the house. Susan attempts to play Cupid, when she introduces Suzanne to Michael, but the girl seems uncannily familiar.','2007-03-02 13:01:45'),(78148,78147,2,'Susan adopts a stray dog. Ben accidentely donates a priceless family heirloom to Goodwill. Abi suspects that Roger is gay.','2007-03-02 13:01:48'),(78164,78163,2,'Ben is away and Susan is invited to dinner by a rich art collector. Her mother, Grace, gathers a collection of her own, and Roger is trying to find the courage to pop the big question to Abi.','2007-03-02 13:01:52'),(78183,78182,2,'Ben tries to avoid Christmas in the Harper house hold but how far is he likely to take it? And how far will Alfie and Micheal take advantage of Ben\'s absence?','2007-03-02 13:01:56');
